		["SF_attn"] = {
			["xOffset"] = 42,
			["customText"] = "function()\n    \n    \n    local enabled = true --set to true/false.\n    \n    \n    if enabled == false then\n        return nil\n    end\n    if aura_env.dur == 0 then\n        return nil\n    else\n        local dec = 0\n        if aura_env.dur <= aura_env.pan then\n            dec = 1\n        end\n        return string.format(\"%.\"..dec..\"f\",aura_env.dur)\n    end\nend",
