					["colorFunc"] = "return function()\n    \n    if (not aura_env.state or not aura_env.state.spellid) then\n        return 1, 0, 0, 1\n    end\n    local spellInfo = aura_env.spells[aura_env.state.spellid]\n    if (aura_env.state.expirationTime - GetTime() <= spellInfo.duration * .3) then\n        return 0, 1, 0, 1\n    else\n        return spellInfo.r, spellInfo.g, spellInfo.b, 1\n    end\nend",
