				["custom"] = "function(allstates, event, ...)\n    \n    local timestamp = GetTime() -- time this event happened.\n    \n    if event == \"COMBAT_RATING_UPDATE\" then\n        aura_env.spells[30108].duration = 8 / (1 + (UnitSpellHaste(\"player\") / 100))\n        return true\n    end\n    \n    \n    --NOTE: THIS WILL NOT HIDE OUTSIDE OF COMBAT IF YOU SET TO FALSE. Do not check the 'load in combat' option either since the aura will cease to work.\n    local AUTOHIDE = false -- mark true or false if you want the bars to hide when they expire.\n    local HideUA = true\n    \n    if type(allstates) ~= \"table\" then\n        return\n    end\n    \n    -- Capturing info from combat log.\n    local _, subevent, _, sourceGUID = ... -- log events and the source ID\n    local destGUID = select(8, ...) -- the destination ID (for us we only care about our effigy)\n    local spellid = select(12, ...) -- the spell id for this log event.\n    allstates[980] = allstates[980] or {} -- this is an error checking safeguard because Agony is a peice of crap.\n    \n    --If the player summoned a Soul Effigy\n    if (subevent == \"SPELL_SUMMON\" and sourceGUID == aura_env.player and spellid == aura_env.SEID) then\n        aura_env.SEGUID = destGUID -- save the GUID of the effigy\n        for k, _ in pairs(allstates) do -- 'reset' all the values in the table\n            allstates[k].expirationTime = 1  \n            allstates[k].duration = 0       \n            allstates[k].changed = true -- indicate to WeakAuras that the aura values have changed.\n        end\n        \n    elseif not spellid or not aura_env.spells[spellid] then return true -- if its a nil spellid or not in the table, skip.\n        \n    elseif subevent == \"SPELL_AURA_APPLIED\" and sourceGUID == aura_env.player and destGUID == aura_env.SEGUID then \n        -- if not aura_env.spells[spellid] then return true end\n        -- If the aura was applied (NOT REFRESHED)\n        local n = aura_env.spells[spellid].name or \"\" -- Get our localized name\n        local i = aura_env.spells[spellid].icon or 0 -- Get the icon for the spell\n        local d = aura_env.spells[spellid].duration or 0 -- Get the base line duration for the spell\n        \n        allstates[spellid] = allstates[spellid] or { } -- error checking\n        \n        allstates[spellid].show = true -- show the aura\n        allstates[spellid].changed = true -- indicate to WeakAuras that the aura values have changed.\n        allstates[spellid].name = n -- Pass in the name to Weak Auras (%n)\n        allstates[spellid].icon = i -- Pass in the icon to Weak Auras\n        allstates[spellid].progressType = 'timed' -- Show that this is a 'timed' aura\n        allstates[spellid].expirationTime = timestamp + d -- Time in the future when this aura will end\n        allstates[spellid].duration = d -- How long the aura should last\n        if spellid == 30108 then allstates[spellid].autoHide = HideUA else allstates[spellid].autoHide = AUTOHIDE end  -- Indicates if we should hide the aura at the end of its duration.\n        allstates[spellid].spellid = spellid\n        \n        \n        \n    elseif ((subevent == \"SPELL_AURA_REFRESH\" and sourceGUID == aura_env.player) or (allstates[980].show and subevent == \"SPELL_CAST_SUCCESS\" and spellid == 980)) and destGUID == aura_env.SEGUID then\n        --if not aura_env.spells[spellid] then return true end\n        -- This section is for if we refresh any of the spells in our aura_env.spells table.\n        local BaseDuration = aura_env.spells[spellid].duration or 0 -- Get the base line duration for the spell\n        local RemainingTime = allstates[spellid].expirationTime - timestamp -- Time left on the debuff when we refreshed.\n        \n        local n = aura_env.spells[spellid].name or \"\" -- Get our localized name\n        local i = aura_env.spells[spellid].icon or 0 -- Get the icon for the spell\n        \n        local pandemic = math.min(BaseDuration * .3, RemainingTime) -- store the smaller of Duration * .3 or Remaining Time.\n        local d = pandemic + BaseDuration -- add the pandemic amount \n        \n        if BaseDuration == 0 then return true end\n        \n        allstates[spellid] = allstates[spellid] or { } -- error checking\n        \n        -------------------\n        \n        allstates[spellid].show = true -- show the aura\n        allstates[spellid].changed = true -- indicate to WeakAuras that the aura values have changed.\n        allstates[spellid].name = n -- Pass in the name to Weak Auras (%n)\n        allstates[spellid].icon = i -- Pass in the icon to Weak Auras\n        allstates[spellid].progressType = 'timed' -- Show that this is a 'timed' aura\n        allstates[spellid].expirationTime = timestamp + d -- Time in the future when this aura will end\n        allstates[spellid].duration = d -- How long the aura should last\n        if spellid == 30108 then allstates[spellid].autoHide = HideUA else allstates[spellid].autoHide = AUTOHIDE end  -- Indicates if we should hide the aura at the end of its duration.\n        allstates[spellid].spellid = spellid\n    end\n    \n    \n    \n    return true\n    \nend\n\n\n",
