			["customText"] = "function()\n    local auraIDs = {156225,164004,164005,164006} -- phase1,2,3,4\n    local msg = \"Move away from the group!\"\n    \n    -- Get the number of stacks for a specific aura\n    local GetAuraStacks = function(unit,spellid)\n        for i=1,40 do\n            local s = select(11, UnitAura(unit, i, 'HELPFUL'))\n            local c = select(4, UnitAura(unit, i, 'HELPFUL'))\n            if s == spellid then return c end\n            s = select(11, UnitAura(unit, i, 'HARMFUL'))\n            c = select(4, UnitAura(unit, i, 'HARMFUL'))\n            if s == spellid then return c end\n        end\n    end\n    \n    -- Loop through all the auras, and return the message if the criteria is correct\n    for i=1,#auraIDs do\n        local stacks = GetAuraStacks('player',auraIDs[i])\n        if stacks and stacks >= 7 and i == 1 then\n            return msg\n        elseif stacks and stacks >= 7 and (i == 2 or i == 3 or i == 4) then\n            return msg\n        end\n    end\n    return \"\"\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
			["untrigger"] = {
				["custom"] = "function()\n    local auraIDs = {156225,164004,164005,164006} -- phase1,2,3,4\n    \n    -- Get the number of stacks for a specific aura\n    local GetAuraStacks = function(unit,spellid)\n        for i=1,40 do\n            local s = select(11, UnitAura(unit, i, 'HELPFUL'))\n            local c = select(4, UnitAura(unit, i, 'HELPFUL'))\n            if s == spellid then return c end\n            s = select(11, UnitAura(unit, i, 'HARMFUL'))\n            c = select(4, UnitAura(unit, i, 'HARMFUL'))\n            if s == spellid then return c end\n        end\n    end\n    \n    -- Loop through all the auras, done deactivate the display if found\n    for i=1,#auraIDs do\n        local stacks = GetAuraStacks('player',auraIDs[i])\n        if stacks and stacks > 0 then return false end\n    end\n    \n    -- Not found, don't deactivate the display\n    WeakAuras.ArcaneWrathStacks = 0\n    return true\nend",
