				["custom"] = "function()\n    local auraIDs = {156225,164004,164005,164006} -- phase1,2,3,4\n    \n    -- Get the number of stacks for a specific aura\n    local GetAuraStacks = function(unit,spellid)\n        for i=1,40 do\n            local s = select(11, UnitAura(unit, i, 'HELPFUL'))\n            local c = select(4, UnitAura(unit, i, 'HELPFUL'))\n            if s == spellid then return c end\n            s = select(11, UnitAura(unit, i, 'HARMFUL'))\n            c = select(4, UnitAura(unit, i, 'HARMFUL'))\n            if s == spellid then return c end\n        end\n    end\n    \n    -- Loop through all the auras, activate the display if found\n    for i=1,#auraIDs do\n        local stacks = GetAuraStacks('player',auraIDs[i])\n        if stacks and stacks > 0 then\n            WeakAuras.ArcaneWrathStacks = WeakAuras.ArcaneWrathStacks or 0\n            if stacks ~= WeakAuras.ArcaneWrathStacks then\n                WeakAuras.ArcaneWrathStacks = stacks\n                local exponent = (i == 3) and 0.25 or 0.5 -- different exponent for phase3\n                local range = tostring(math.ceil(200*((1-exponent)^(stacks-1))))\n                local msg = string.format(\"Branded(%s) on %s(%syd)\",\n                    tostring(stacks), UnitName('player'), range)\n                SendChatMessage(msg, 'yell')\n            end\n            return true\n        end\n    end\n    \n    -- Not found, don't show the display\n    return false\nend",
