				1, -- [4]
			},
			["displayText"] = "%c",
			["customText"] = "function()\n    if not WA_Uplift or not WA_Uplift.data.deficit then return \"-\" end\n    local retVal = WA_Uplift.data.deficit\n    if retVal > 1000 then\n        retVal = (\"%.01fk\"):format(retVal / 1000)\n    end\n    \n    if WA_Uplift.data.uplift then\n        local amount = WA_Uplift.data.uplift.effective\n        if amount > 1000 then\n            amount = (\"%.01fk\"):format(amount / 1000)\n        end\n        retVal = retVal .. \"\\n\"..amount \n    end\n    return retVal\nend",
			["yOffset"] = 44.7958984375,
