			["id"] = "Uplift Estimate",
			["trigger"] = {
				["type"] = "custom",
				["custom_type"] = "event",
				["custom_hide"] = "custom",
				["unevent"] = "auto",
				["event"] = "Conditions",
				["use_unit"] = true,
				["names"] = {
				},
				["events"] = "COMBAT_LOG_EVENT_UNFILTERED",
				["custom"] = "-- Renewing Mist Tracking Aura\n-- Author: Zhin @ EU-Blackhand (ccKep @ mmo-champ forums)\n-- Date: 11/19/2012 rev. 2\nfunction(event, ...)\n    if not WA_Uplift then\n        WA_Uplift = {\n            data = {\n                deficit = 0\n            },\n            updateInterval = 0.5, -- Adjust this to control update frequency\n            lastRefresh = 0,\n            \n            hasRenewingMist = function(self,unit)\n                local idx = 1\n                local name, _, _, _, _, _, expirationTime, unitCaster, _, _, spellId = UnitAura(unit, idx, \"HELPFUL|PLAYER\")\n                while name do\n                    if spellId == 119611 then            -- Renewing Mist HoT\n                        if unitCaster == \"player\" then\n                            return expirationTime\n                        end\n                    end        \n                    idx = idx + 1\n                    name, _, _, _, _, duration, expirationTime, unitCaster, _, _, spellId = UnitAura(unit, idx, \"HELPFUL|PLAYER\")\n                end\n                return nil\n            end,\n            \n            Refresh = function(self)\n                self.lastRefresh = GetTime()\n                \n                local estUplift = 1.2 * (7794 + 0.68 * GetSpellBonusHealing())\n                local deficit = 0\n                \n                local prefix = \"raid\"\n                local numPlayers = GetNumGroupMembers()\n                \n                if not IsInRaid() then\n                    prefix = \"party\"\n                    \n                    -- player does not count toward party members\n                    numPlayers = numPlayers - 1\n                    \n                    local expirationTime = self:hasRenewingMist(\"player\")\n                    if expirationTime then\n                        local d = UnitHealthMax(\"player\") - UnitHealth(\"player\")\n                        deficit = deficit + math.min(estUplift, d)\n                    end\n                end\n                \n                for idx=1, numPlayers do\n                    local unit = prefix..idx\n                    \n                    local expirationTime = self:hasRenewingMist(unit)\n                    if expirationTime then\n                        local d = UnitHealthMax(unit) - UnitHealth(unit)\n                        deficit = deficit + math.min(estUplift, d)\n                    end\n                end\n                \n                if not self.data then self.data = {} end\n                \n                self.data.deficit = deficit\n            end,\n            \n            Uplift = function(self,amount,over,absorbed)\n                local effective = amount-over\n                \n                if not self.lastUplift then\n                    self.lastUplift = 0\n                end\n                \n                local dt = GetTime() - self.lastUplift\n                \n                if not self.data then self.data = {} end\n                \n                if dt > 0.5 then\n                    self.data.uplift = {\n                        effective = 0,\n                        over = 0\n                    }\n                end\n                \n                self.lastUplift = GetTime()\n                \n                self.data.uplift.effective = self.data.uplift.effective + effective\n                self.data.uplift.over = self.data.uplift.over + over\n            end\n        }\n    end\n    \n    local _, clEvent = ...\n    local srcGUID = select(4, ...)\n    local spellId = select(12, ...)\n    \n    -- Renewing Mist triggered a combat log event -> update\n    if clEvent ~= \"SPELL_CAST_SUCCESS\" and clEvent ~= \"SPELL_PERIODIC_HEAL\" then\n        if srcGUID and srcGUID == UnitGUID(\"player\") then\n            if spellId and spellId == 119611 then\n                WA_Uplift:Refresh()\n            end\n        end\n    end\n    \n    -- Uplift (116670)\n    if clEvent == \"SPELL_HEAL\" and spellId == 116670 then\n        local amount,over,absorbed = select(15, ...)\n        WA_Uplift:Uplift(amount,over,absorbed)\n    end\n    \n    \n    -- Force update if WA_Uplift.updateInterval seconds have passed since last update\n    local curTime = GetTime()\n    if curTime - WA_Uplift.lastRefresh > WA_Uplift.updateInterval then\n        WA_Uplift:Refresh()\n    end\n    \n    return true\n    --    return WA_Uplift.data.deficit > 0\nend",
