				["custom"] = "function(allstates, event, time, subevent, ...)\n    --if the states is not a table, ABORT\n    if type(allstates) ~= \"table\" then\n        return\n    end\n    \n    --clean up the table when entries expired\n    local i = 1\n    while(allstates[i]) do\n        if allstates[i].show then\n            i = i + 1\n        else\n            table.remove(allstates, i)\n        end\n    end\n    \n    --source and destGUID\n    local sourceName = select(3, ...)\n    local destGUID = select(6, ...)\n    \n    --trigger for player casts\n    if subevent == \"SPELL_CAST_SUCCESS\" and sourceName == UnitName(\"player\") then\n        \n        --spellID 589 = SW:P\n        local spellID = select(10, ...)\n        if spellID == aura_env.spellID then\n            \n            local state = {}\n            \n            --check if there is already a state for the current destGUID\n            for i,v in ipairs(allstates) do\n                if v.name == destGUID then\n                    state = allstates[i]\n                    break\n                end\n            end\n            --if there is none, create a new one\n            if not state.name then\n                allstates[#allstates + 1] = state\n            end\n            \n            --set the stuff that is needed\n            state.show = true\n            state.changed = true\n            state.name = destGUID\n            state.progressType = 'timed'\n            state.expirationTime = GetTime() + aura_env.dur\n            state.duration = aura_env.dur\n            state.autoHide = true\n            state.resort = true\n            state.icon = select(3, GetSpellInfo(aura_env.spellID))\n            \n        end\n    end\n    \n    return true\nend",
