			["customText"] = "--display\nfunction()\n    \n    aura_env.returnString = \"\" -- this is the string that will display the table\n    if aura_env.hasDebuffTable == nil then return \"\"    end\n    for k,v in pairs(aura_env.hasDebuffTable) do -- for every item in this table\n        --print (k,v)\n        local name = v\n        local timer = string.format(\"%.1f\",  aura_env.debuffTimer[k] - GetTime()) -- store the timer for the first person\n        local distance = string.format(\"%.1f\", aura_env.DistanceBetweenUnits(\"player\", aura_env.raiderUnitID[k]))\n        \n        timer = tonumber(timer)\n        distance = tonumber(distance)\n        \n        if timer <= 0 then -- check if the timer is expired\n            table.remove(aura_env.debuffTimer, k) -- remove the items from the table.\n            table.remove(aura_env.hasDebuffTable, k)\n            table.remove(aura_env.raiderUnitID, k)\n            break\n        end\n        \n        \n        local red = \"|cFFCC0000\"\n        local yellow = \"|cFFFFFF00\"\n        local green = \"|cFF66FF33\"\n        \n        if UnitName(\"player\") == name then\n            timer = green..timer..\"|r\"\n            name = green..\"((\"..name..\"))\"..\"|r\"\n            distance = green..distance..\"|r\"\n        elseif distance <= 20 then \n            timer = red..timer..\"|r\" \n            name = red..\">>\"..name..\"<<\"..\"|r\"\n            distance = red..distance..\"|r\"\n        elseif distance <= 40 then\n            timer = yellow..timer..\"|r\" \n            name = yellow..\">\"..name..\"<\"..\"|r\"\n            distance = yellow..distance..\"|r\"\n        elseif distance > 40 then\n            timer = green..timer..\"|r\"\n            name = green..name..\"|r\"\n            distance = green..distance..\"|r\"\n        end\n        \n        if UnitName(\"player\") == name then\n            timer = green..timer..\"|r\"\n            name = green..\"((\"..name..\"))\"..\"|r\"\n            distance = green..distance..\"|r\"\n        end\n        \n        \n        aura_env.returnString = aura_env.returnString .. \"\\n\".. string.format(\"%s - %s\",  name, distance)  -- store the information on the display string\n        \n        \n        \n        \n        \n        \n    end\n    \n    return aura_env.returnString -- return the table.\n    \n    \n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
