				["use_unit"] = true,
				["names"] = {
				},
				["subeventSuffix"] = "_CAST_START",
				["custom"] = "-- Trigger\n\n--Version 1.2: July 5th 2015\n\nfunction(event, timestamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags,  spellid, spellName)\n    \n    local SPELL = \"Touch of Doom\"\n    --local SPELL = \"Rejuvenation\"\n    \n    \n    \n    \n    if subevent == \"SPELL_AURA_APPLIED\" and spellName == SPELL then\n        \n        local name =  string.gsub(destName, \"%-[^|]+\", \"\") -- remove realm names, if any\n        \n        table.insert(aura_env.debuffTimer, GetTime() + 8) -- insert into the timer table 30s to countdown from.\n        table.insert(aura_env.hasDebuffTable,  name) -- insert the person who has the debuff\n        \n        for i=1, GetNumGroupMembers() do\n            local raider = \"raid\"..i\n            if UnitName(raider) == name then\n                table.insert(aura_env.raiderUnitID, raider)\n                break    \n            end            \n        end\n        \n        \n    elseif  subevent == \"SPELL_AURA_REMOVED\" and spellName == SPELL then -- check if the aura is removed.\n        \n        local name =  string.gsub(destName, \"%-[^|]+\", \"\") -- remove realm names, if any\n        \n        for k,v in pairs(aura_env.hasDebuffTable) do -- for every player that has the debuff\n            \n            if v == name then -- check if their name matches\n                table.remove(aura_env.debuffTimer, k) -- remove the items from the table.\n                table.remove(aura_env.raiderUnitID, k)\n                table.remove(aura_env.hasDebuffTable, k)\n                \n            end\n            \n        end\n        \n    end\n    return true \nend\n\n\n\n\n\n\n\n",
