			["displayText"] = "%c",
			["customText"] = "function()\n    --config start\n    local playSoundOnSwitch = true\n    local iconSize = 12\n    \n    --[[\nIcons\n8 = {skull}\n7 = {cross}\n6 = {square}\n5 = {moon}\n4 = {triangle}\n3 = {diamond}\n2 = {circle}\n1 = {star}\n]]\n    local icoL1 = 2 \n    local icoL2 = 3 \n    local icoL3 = 4 \n    local icoL4 = 5\n    local icoNE = 1\n    local icoE = 7\n    local icoNW = 6\n    local icoSW = 8  \n    --config end\n    \n    if aura_env.EngageTime then\n        local icons = {}\n        for i=1,8 do\n            icons[i] = string.format(\"\\124TInterface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_%d:%d\\124t\", i, iconSize)\n        end\n        \n        local dataMythic = {\n            {0, 30, icons[icoL3], icons[icoL2], \"Adds -> Fire\"}, \n            {30, 45, icons[icoL2], \"Triple (1/2)\", \" \"},\n            {45, 63, \"Triple (1/2)\", \"Triple (2/2)\", \" \"},\n            {63, 77, \"Triple (2/2)\", icons[icoL3], \" \"},\n            {77, 100, icons[icoL3], icons[icoL2], \"Double Cannons\"},\n            {100, 135, icons[icoL2], \"Split \"..icons[icoL1]..\"/\"..icons[icoL4], \"Raid\"..icons[icoL1]..\"/Tank\"..icons[icoL4]},\n            {135, 169, \"Split \"..icons[icoL1]..\"/\"..icons[icoL4], icons[icoL2], \" \"},\n            {169, 191, icons[icoL2], icons[icoSW], \"Train -> Fire\"},\n            {191, 205, icons[icoSW], icons[icoL4], \"Debuff -> Portal\"},\n            {205, 210, icons[icoL4], \"Triple (1/2)\", \" \"},\n            {210, 225, \"Triple (1/2)\", \"Triple (2/2)\", \" \"},\n            {225, 237, \"Triple (2/2)\", icons[icoL3], \" \"},\n            {237, 262, icons[icoL3], icons[icoNW], \"Cannon + Adds\"},\n            {262, 273, icons[icoNW], icons[icoL2], \" \"}, -----\n            {273, 283, icons[icoL2], icons[icoNE], \"Fire\"},\n            {283, 295, icons[icoNE], \"Split \"..icons[icoL1]..\"/\"..icons[icoL4], \"Tank\"..icons[icoL1]..\"/Raid\"..icons[icoL4]},\n            {295, 318, \"Split \"..icons[icoL1]..\"/\"..icons[icoL4], icons[icoL3], \" \"},\n            {318, 329, icons[icoL3], icons[icoL4], \" \"},\n            {329, 340, icons[icoL4], \"Triple (1/2)\", \" \"},\n            {340, 355, \"Triple (1/2)\", \"Triple (2/2)\", \" \"},\n            {355, 368, \"Triple (2/2)\", icons[icoL2]..\"/\"..icons[icoL3], \" \"},\n            {368, 389, icons[icoL2]..\"/\"..icons[icoL3], icons[icoE], \"Cannon + Adds\"},\n            {389, 410, icons[icoE], icons[icoL3], \"Squeeze past\"},\n            {410, 443, icons[icoL3], icons[icoSW], \"Adds -> Fire\"},\n            {443, 450, icons[icoSW], icons[icoL4], \" \"},\n            {450, 465, icons[icoL4], icons[icoL2], \"Debuff -> Fire\"},\n            {465, 470, icons[icoL2], \"Triple (1/2)\", \"Ignore Adds\"},\n            {470, 485, \"Triple (1/2)\", \"Triple (2/2)\", \"Ignore Adds\"},\n            {485, 490, \"Triple (2/2)\", \" \", \" \"}\n        }\n        \n        --thanks to Krazyito for this data :)\n        local dataNH = {\n            {0, 30, icons[icoL3], icons[icoL2], \"Wait for \" .. icons[icoL2] .. \" then go there.\"},\n            {30, 50, icons[icoL2], icons[icoL3], \"Kill adds\"},\n            {50, 80, icons[icoL3], icons[icoL2], \"Kill cannon on \" .. icons[icoL4] .. \" and move quick.\"},\n            {80, 120, icons[icoL2], \"Split \" ..icons[icoL1]..\"/\"..icons[icoL4], \"Kill adds from \" .. icons[icoL1] .. \"\\124nSplit happens at 2:00\"},\n            {120, 155, \"Split \" ..icons[icoL1]..\"/\"..icons[icoL4], icons[icoL3], \"Move into middle lanes as train goes away.\"},\n            {155, 190, icons[icoL3], icons[icoL2], \"Kill cannon on \" .. icons[icoL1] .. \" from \" .. icons[icoL3]},\n            {190, 220, icons[icoL2], icons[icoL3], \"Kill adds from \" .. icons[icoL4]},\n            {220, 240, icons[icoL3], icons[icoL1], \" \"},\n            {240, 270, icons[icoL1] .. \" -> \" .. icons[icoL2], icons[icoL2], \"Kill adds on\" .. icons[icoL2] .. \" and cannon on \" .. icons[icoL4]},\n            {270, 285, icons[icoL2], icons[icoL3], \" \"},\n            {285, 360, icons[icoL3], \"Split \" ..icons[icoL1]..\"/\"..icons[icoL4], \"Double Cannons on \" .. icons[icoL1] .. \"/\" .. icons[icoL4] .. \"\\124nSplit happens at 6:10~\"},\n            {360, 400, \"Split \" ..icons[icoL1]..\"/\"..icons[icoL4], icons[icoL3], \" \"},\n            {400, 436, icons[icoL3], icons[icoL2], \"Lots of adds from \" .. icons[icoL1] .. \" and \" .. icons[icoL4]},\n            {436, 445, icons[icoL2], icons[icoL3], \" \"}\n        }\n        \n        local data = {}\n        if aura_env.difficultyID == 16 then\n            data = dataMythic\n        else\n            data = dataNH\n        end\n        \n        local combatTime = GetTime() - aura_env.EngageTime\n        local line1, line2, line3 = \"no data\", \"no data\", \"no data\"\n        \n        for i,v in ipairs(data) do\n            if combatTime >= v[1] and combatTime < v[2] then\n                line1, line2, line3 = v[3], v[4], v[5]\n                if playSoundOnSwitch and i > aura_env.LastDisplayed then\n                    aura_env.LastDisplayed = i\n                    PlaySound(\"QUESTADDED\", \"master\");\n                end\n            end\n        end\n        \n        return string.format([[\n%02d:%02d\nPosition: %s\nNext Pos: %s\n%s]], combatTime/60, combatTime%60, line1, line2, line3)\n    end\n    \n    return \"Timer\\nPosition: Position\\nNext Pos: Position\\nExtra Info\"\nend",
