		["heart seeker"] = {
			["outline"] = true,
			["xOffset"] = 0,
			["displayText"] = "%c",
			["customText"] = "function()\n    \n    local icons = {}\n    for i=1,4 do\n        icons[i] = string.format(\"\\124TInterface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_%d:16\\124t\", i) -- 1: star, 2: circle, 3: diamond, 4: triangle\n    end\n    \n    local positions = {\"LEFT MELEE\", \"RIGHT MELEE\", \"LEFT RANGE\", \"RIGHT RANGE\"} -- positions to give people\n    for i,v in pairs(aura_env.playerInfo) do\n        if UnitName(\"player\") == v then -- if the player name is in the table\n            local  _, _, _, _, _, _, expirationTime = UnitDebuff(\"player\",  aura_env.SPELL) -- get the time in the future when it expires\n            if expirationTime == nil then return \"\" end -- if its nil, the buff is gone\n            local timer = expirationTime - GetTime() -- time in future minus current time\n            \n            return icons[i] .. positions[i].. icons[i] .. \"\\n\" .. string.format(\"%.1f\", timer) -- return all info\n        end\n    end\nend",
			["untrigger"] = {
				["custom"] = "function()\n    \n    local  _, _, _, _, _, _, expirationTime = UnitDebuff(\"player\",  aura_env.SPELL) --  get the time in the future when it expires\n    \n    if expirationTime == nil then  -- if its nil we dont have a debuff, so no aura should show, also reset the table (just in case)\n        aura_env.playerInfo = {}\n        return true\n    end\n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
			},
			["anchorPoint"] = "CENTER",
			["activeTriggerMode"] = 0,
			["customTextUpdate"] = "update",
			["actions"] = {
