			},
			["displayText"] = "%c",
			["customText"] = "function()\n    \n    --WeakAuras.ScanEvents('MARKER_ARROW_ON', aura_env.marker)\n    if aura_env.showArrow then\n        local size = 64 -- defualt 16\n        -- print(\"SHOW ARROW\")\n        return GExRT.F.ArrowTextPlayer(aura_env.markedPlayerName, size)\n    end\n    \n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n",
			["untrigger"] = {
				["custom"] = "function(event)\n    \n    if event == \"MARKER_ARROW_OFF\" then\n        aura_env.showArrow = false\n        return true\n    end\n    \nend\n\n\n\n\n\n\n\n\n\n",
			},
