				["events"] = "MARKER_ARROW_ON, MARKER_ARROW_OFF",
				["custom"] = "function(event, mark)\n    \n    if event == \"MARKER_ARROW_ON\" then\n        for i=1,GetNumGroupMembers() do\n            \n            local raider=\"raid\"..i\n            local raiderName = UnitName(raider)\n            raiderName = string.gsub(raiderName, \"%-[^|]+\", \"\") -- remove realm names, if any\n            \n            local icon = GetRaidTargetIndex(raider);\n            if icon == mark then\n                aura_env.markedPlayerName = raiderName\n                aura_env.showArrow = true\n                return true\n            end\n        end\n    end\nend",
