			["customText"] = "function()\n    \n    ViserA = ViserA or false\n    ViserB = ViserB or false\n    \n    --print(ViserB)\n    \n    LastProcA = LastProcA or GetTime()\n    LastProcB = LastProcB or GetTime()\n    \n    LastProcAttempt = LastProcAttempt or GetTime()\n    \n    local LastUpdateA = GetTime()-LastProcA\n    local LastUpdateB = GetTime()-LastProcB\n    \n    rppm_A_13 = rppm_A_13 or 0\n    rppm_A_14 = rppm_A_14 or 0\n    \n    rppm_B = rppm_B or 0\n    \n    rppm_A_13 = LastUpdateA\n    rppm_A_14 = LastUpdateB\n    \n    rppm_B = 2 or GetTime() - LastProcAttempt\n    \n    local rppm_R_13 = a7 or 1\n    local rppm_R_14 = b7 or 1\n    \n    if rppm_A_13 <= 1 then rppm_A_13 = 1 end\n    if rppm_A_14 <= 1 then rppm_A_14 = 1 end\n    \n    if rppm_B >= 10 then rppm_B = 10 end\n    \n    local calc13\n    local calc14\n    \n    \n    if rppm_R_13 ~= nil then\n        calc13 = (1 + (3 * ( rppm_A_13 / ( 60 / rppm_R_13 )) - 1.5 ) ) * (rppm_R_13 * rppm_B / 60)\n        \n        calc13 = calc13 * 100\n        \n        if calc13 < 0 then calc13 = 0 end\n        if calc13 > 100 then calc13 = 100 end\n        \n    end\n    \n    if rppm_R_14 ~= nil then\n        calc14 = (1 + (3 * ( rppm_A_14 / ( 60 / rppm_R_14 )) - 1.5 ) ) * (rppm_R_14 * rppm_B / 60)\n        \n        calc14 = calc14 * 100\n        \n        if calc14 < 0 then calc14 = 0 end\n        if calc14 > 100 then calc14 = 100 end\n        \n    end\n    \n    calcA = calc13 or 0\n    calcB = calc14 or 0\n    \n    if calc13 == nil then calc13 = 0 end\n    if calc14 == nil then calc14 = 0 end\n    \n    --[[\n    \n    if a7 ~= nil then\n        print(LastUpdateA..\" - A - \"..a7)\n    end\n    if b7 ~= nil then\n        print(LastUpdateB..\" - B - \"..b7)\n    end\n\n    ]]--\n    \n    --return (string.format(\"%.2f\", calc13)..\"%% :: \"..string.format(\"%.2f\", calc14)..\"%%\"..\" :: Time: \"..rppm_A_13)\n    \nend",
