			["displayText"] = "%c",
			["customText"] = "function()\n    \n    ---------------------OPTIONS-------------------------\n    local showTargetting = true -- Change this to fasle if you only want to show players that are NOT targetting your target.\n    --------------------------------------------------------\n    \n    local returnString = \"\"\n    if UnitInRaid(\"player\") then -- check if the player is in a raid\n        \n        local playertarget = UnitGUID(\"target\") -- get the Unique ID of the target\n        \n        \n        for i=1,GetNumGroupMembers() do -- cycle through raid\n            local raider=\"raid\"..i \n            local raidertarget = UnitGUID(raider..\"target\") -- get current raider target ID\n            local name = UnitName(raider)\n            \n            if showTargetting then -- If we want to show players that are targetting my target\n                if raidertarget == playertarget then\n                    returnString = returnString .. name .. \"\\n\"\n                end\n            else -- If we want to show players that are NOT targetting my taget\n                if raidertarget ~= playertarget then \n                    returnString = returnString .. name .. \"\\n\"\n                end\n            end\n        end\n        return returnString\n    else\n        return \"Not in a raid\"\n    end\n    \n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
