					["custom"] = "C_Timer.After(1, \n    \n    function()\n        \n        aura_env.wrought = {}\n        aura_env.focused = {}\n        \n        for i = 1, GetNumGroupMembers() do\n            \n            local raider = \"raid\"..i\n            \n            local hasWrought = UnitDebuff(raider, \"Wrought Chaos\")\n            local hasFocused = UnitDebuff(raider, \"Focused Chaos\")\n            \n            if hasWrought then\n                table.insert(aura_env.wrought, raider)\n            elseif hasFocused then\n                table.insert(aura_env.focused, raider)\n            end\n            \n        end\n        \n        \n        local hasWrought = UnitDebuff(\"player\", \"Wrought Chaos\")\n        local hasFocused = UnitDebuff(\"player\", \"Focused Chaos\")\n        \n        table.sort(aura_env.wrought)\n        table.sort(aura_env.focused)\n        \n        if hasWrought then\n            \n            for i, v in ipairs(aura_env.wrought) do\n                \n                if UnitIsUnit(\"player\", v) then\n                    aura_env.number = i\n                    SendChatMessage(i)\n                    break\n                end\n            end\n            \n            \n        elseif hasFocused then\n            \n            for i, v in ipairs(aura_env.focused) do\n                if UnitIsUnit(\"player\", v) then\n                    aura_env.number = i + 10\n                    SendChatMessage(i+ 10)\n                    break\n                end    \n            end\n            \n        else\n            aura_env.number = \"No debuff? GL\"\n            SendChatMessage(\"No debuff?\")\n        end\n        \nend)\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
