				["custom"] = "\n\nfunction(event, ...)\n    \n    if event == \"ENCOUNTER_START\" then\n        local encounterID, encounterName, difficultyID, raidSize = ...\n        if encounterName == \"Blackhand\" then\n            WA_BF10_phase = 1\n            WA_BF10_marktext = \"\"\n            WA_BF10_marks = {}\n        end\n    end\n    \n    if event == \"CHAT_MSG_MONSTER_YELL\" then\n        local msg = ...\n        \n        if msg:find(\"Everyone DOWN\") or msg:find(\"no one will be able to put YOU back together\") then\n            WA_BF10_phase = 2\n        end\n        \n        if msg:find(\"you will all BURN\") or msg:find(\"molten heart will devour you\") then\n            WA_BF10_phase = 3 \n        end\n    end\n    \n    \n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local timeStamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellId, spellName, spellSchool, extraSpellID, extraSpellName, extraSchool = ...\n        \n        if subevent == \"SPELL_AURA_APPLIED\" and spellName == \"Marked for Death\" then\n            \n            table.insert(WA_BF10_marks, destName)    \n            \n            C_Timer.After(5, function() WA_BF10_marks = {} end)\n            \n            if #WA_BF10_marks == 3 then\n                table.sort(WA_BF10_marks)\n                local positions = {\"LEFT\", \"MIDDLE\", \"RIGHT\"}\n                for i = 1, #WA_BF10_marks do\n                    local position = table.remove(positions, 1)\n                    if UnitName(\"player\") == WA_BF10_marks[i] then \n                        SendChatMessage(position .. \" Mark\")\n                        WA_BF10_marktext = position\n                        return true\n                    end\n                end\n            end\n        end\n    end        \nend    \n\n\n\n",
