				["duration"] = "5",
				["event"] = "Chat Message",
				["unit"] = "player",
				["names"] = {
				},
				["subeventPrefix"] = "SPELL",
				["custom"] = "--Lust Timer Trigger\nfunction (event, ...)\n    \n    --[[HELLFIRE CITADEL VERSION\n\nHellfire Assult - 1778\nIron Reaver - 1785\nKormrok - 1787\nHellfire High Council - 1798\nKilrogg Deadeye - 1786\nGorefiend - 1783\nShadow-Lord Iskar - 1788\nXhul'horac - 1800\nFel Lord Zakuun - 1777\nSocrethar the Eternal - 1794\nTyrant Velhari - 1784\nMannoroth - 1795\nArchimonde - 1799\n]]\n    -- Mythic = 16, use the same list for heroic/normal\n    -- CHECK MYTHIC? \n    \n    local id, name, difficulty, size, status = ... -- ENCOUNTER START / END VARS\n    local timestamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags,  spellid, spellName = ... -- Combat Log Event Unfitlered vars\n    \n    \n    --[[-------------------------------------\n         For the easy bosses, where you lsut at the start, as well as setting true our variables to use in our 'loop'\n      ]]\n    \n    if event == \"ENCOUNTER_START\" then\n        \n        if id == 1778 then -- Hellfire Assult\n            -- At the start\n            return true\n        elseif id == 1785 then -- Reaver\n            -- At the start\n            return true\n        elseif id == 1787 then -- Kormrok\n            -- At the start\n            return true \n        elseif id == 1798 then -- Council\n            -- Lust after first 2 bosses are dead, (and dia hits 30%)\n            aura_env.hellfireCouncil = true\n        elseif id == 1786 then --Kilrogg\n            -- At the start\n            return true\n        elseif id == 1783 then -- Gorefiend\n            -- Lust during  SECOND Feast of Souls\n            aura_env.gorefiend = true\n            aura_env.count = 0\n        elseif id == 1788 then --Iskar\n            --Lust on the Fel Raven\n        elseif id == 1800 then --Xhul'haroc\n            -- Phase 4, check some conditions\n        elseif id == 1777 then -- Fel Lord\n            -- Last phase (30/25%)\n        elseif id == 1794 then --Socrethar\n            --On first dominator\n        elseif id == 1784 then -- Velhari\n            --Last phase, 40-30%?\n        elseif id == 1795 then -- Mannoroth\n            -- Last phase 35%\n        elseif id == 1799 then -- Archimonde\n            -- Last Phase 20%?\n        end\n    end-- encounter start\n    \n    \n    \n    --[[-------------------------------------\n         The 'Loop' based on every event that happens in the fight, this checks conditions of the boss fight to know when to lust.\n      ]]\n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        \n        if aura_env.hellfireCouncil then -- Council \n            -- Lust after first 2 bosses are dead, (and dia hits 30%)\n            -- Might need extra check to make sure other 2 bosses are dead... but this should work if you do it right.\n            for i=1, 3 do \n                local boss = \"boss\"..i\n                local exists = UnitExists(boss)\n                if exists and UnitName(boss) == \"Dia Darkwhisper\" then\n                    local health = UnitHealth(boss)\n                    local max_health = UnitHealthMax(boss)                \n                    if ((health/max_health) * 100) <= 30 then\n                        return true\n                    end\n                end\n            end\n        end-- Hellfire Council\n        \n        if aura_env.gorefiend then\n            -- Lust during SECOND Feast of Souls\n            if subevent == \"SPELL_CAST_START\" and spellName == \"Feast of Souls\"then\n                aura_env.count = aura_env.count + 1\n                \n                if aura_env.count == 2 then\n                    return true\n                end\n                \n            end\n            \n            \n        end-- Gorefiend\n        \n    end-- combatlog event\n    \n    --[[-------------------------------------------------------\n          Trigger when the Encounter Ends to reset variables.\n       ]]\n    if event == \"ENCOUNTER_END\" then\n        if id == 1798 then -- Council\n            aura_env.hellfireCouncil = false\n        elseif id == 1783 then -- Gorefiend\n            aura_env.gorefiend = false\n            aura_env.count = 0\n        end \n    end-- encounter end\n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
