				["custom"] = "function()\n    if aura_env.pan >= aura_env.dur then\n        -- ideal pandemic time\n        WeakAuras.regions[aura_env.id].region:SetSize(aura_env.dW * aura_env.scale,aura_env.dH * aura_env.scale)\n    else\n        -- not pandemic time\n        local x,y = WeakAuras.regions[aura_env.id].region:GetSize()\n        if x ~= aura_env.dW  or y ~= aura_env.dH then\n            WeakAuras.regions[aura_env.id].region:SetSize(aura_env.dW,aura_env.dH)\n        end\n        \n    end\n    local expires = select(7,UnitDebuff(\"target\", GetSpellInfo(aura_env.spellid), false, \"player\")) or 0\n    local duration = expires - GetTime()\n    if duration <= 0 then duration = 0 end\n    aura_env.dur = duration\n    if duration == 0 then\n        WeakAuras.regions[aura_env.id].region.icon:SetDesaturated(true)\n    else\n        WeakAuras.regions[aura_env.id].region.icon:SetDesaturated(false)\n    end\n    return true\nend",
