			["displayText"] = "%c",
			["customText"] = "function() -- SOUND LOOPER TEXT\n    local timestamp = GetTime()\n    local macroText = \"<Rebuff For Confidence> is selling Mythic HFC.  6/13M, 11/13M and 12/13M packages.  Blackhand mount also available. Raid days are Tuesday/Wednesday at 8:30 server. Pst for more info.\"\n    if not aura_env.sounds then return end\n    for i, sound in pairs(aura_env.sounds) do\n        if sound.active then \n            if sound.lastPlayback then\n                if (sound.lastPlayback + sound.duration) < timestamp then\n                    sound.lastPlayback = timestamp\n                    PlaySoundFile(sound.path, 'Master')\n                    if sound.macro then\n                        SendChatMessage(macroText, \"CHANNEL\", nil, \"2\")\n                    end                        \n                end\n            else\n                sound.lastPlayback = timestamp\n                PlaySoundFile(sound.path, 'Master')\n                if sound.macro then\n                    SendChatMessage(macroText, \"CHANNEL\", nil, \"2\")\n                end        \n            end\n        end\n    end\nend",
