f math.floor(_G[\"WA_expiration\"] - GetTime()) > -0.5 then\n            \n            Text = Text..\"\\n\"..math.floor(_G[\"WA_expiration\"] - GetTime() + 0.5)\n            \n        end\n    end\n    if index==4 then\n        Text = Icons[\"triangle\"]..\" MELEE RIGHT \"..Icons[\"triangle\"]\n        if math.floor(_G[\"WA_expiration\"] - GetTime()) > -0.5 then\n            \n            Text = Text..\"\\n\"..math.floor(_G[\"WA_expiration\"] - GetTime() + 0.5)\n            \n        end\n    end\n    if Text == \"yellow\" then\n        Text = Icons[\"star\"]..\"SOAK\"..Icons[\"star\"]\n    end\n    if Text == \"orange\" then\n        Text = Icons[\"circle\"]..\"SOAK\"..Icons[\"circle\"]\n    end\n    if Text == \"purple\" then\n        Text = Icons[\"diamond\"]..\"SOAK\"..Icons[\"diamond\"]\n    end\n    if Text == \"green\" then\n        Text = Icons[\"triangle\"]..\"SOAK\"..Icons[\"triangle\"]\n    end\n    \n    \n    return Text\n    \n    \n    \n    \n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
