				["custom_hide"] = "timed",
				["custom"] = "function(event, timestamp, event, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellID, spellName, spellSchool)\n    \n    if event == \"SPELL_AURA_APPLIED\" and spellID == 184964 then\n        _G[\"WA_MARK\"] = nil\n        _G[\"WA_expiration\"] = nil\n        return false\n    end\n    \n    if event == \"SPELL_AURA_APPLIED\" and spellID == 187050 then\n        if not   _G[\"WA_MARK\"]  then\n            _G[\"WA_MARK\"] = {}\n        end\n        table.insert(_G[\"WA_MARK\"], destName)\n        \n        if #_G[\"WA_MARK\"] == 4 then\n            name, realm = UnitName(\"player\")\n            Marks = 4\n            -- Change  \"No Mark\" into either \"yellow\" \"orange\" \"purple\" or \"green\" to match your assigned soaking group.\n            -- this is optional though. If you don't change it, it will just display \"No Mark\" if you don't get a mark.\n            -- If you write your color it will show you where to help soaking if you didn't get a Mark.\n            -- yellow == Ranged Left, orange == Ranged Right, purple == Melee Left, green == Melee Right\n            Text  = \"No Mark\"\n            SetRaidTarget(_G[\"WA_MARK\"][1], 1)\n            SetRaidTarget(_G[\"WA_MARK\"][2], 2)\n            SetRaidTarget(_G[\"WA_MARK\"][3], 3)\n            SetRaidTarget(_G[\"WA_MARK\"][4], 4)\n            \n            if _G[\"WA_MARK\"][1] == name then\n                name, rank, icon, count, debuffType, duration = UnitDebuff(\"player\",\"Mark of the Legion\")\n                _G[\"WA_expiration\"] = GetTime() + duration\n                SendChatMessage(\"{rt1} RANGED LEFT {rt1}\",\"SAY\")\n                PlaySoundFile(WeakAuras.PowerAurasSoundPath..\"sonar.ogg\", \"master\") \n                return true\n            end\n            if _G[\"WA_MARK\"][2] == name then\n                name, rank, icon, count, debuffType, duration = UnitDebuff(\"player\",\"Mark of the Legion\")\n                _G[\"WA_expiration\"] = GetTime() + duration\n                SendChatMessage(\"{rt2} RANGED RIGHT {rt2}\",\"SAY\")\n                PlaySoundFile(WeakAuras.PowerAurasSoundPath..\"sonar.ogg\", \"master\") \n                return true\n            end\n            if _G[\"WA_MARK\"][3] == name then\n                name, rank, icon, count, debuffType, duration = UnitDebuff(\"player\",\"Mark of the Legion\")\n                _G[\"WA_expiration\"] = GetTime() + duration\n                SendChatMessage(\"{rt3} MELEE LEFT {rt3}\",\"SAY\")\n                PlaySoundFile(WeakAuras.PowerAurasSoundPath..\"sonar.ogg\", \"master\") \n                return true\n            end\n            if _G[\"WA_MARK\"][4] == name then\n                name, rank, icon, count, debuffType, duration = UnitDebuff(\"player\",\"Mark of the Legion\")\n                _G[\"WA_expiration\"] = GetTime() + duration\n                SendChatMessage(\"{rt4} MELEE RIGHT {rt4}\",\"SAY\")\n                PlaySoundFile(WeakAuras.PowerAurasSoundPath..\"sonar.ogg\", \"master\") \n                return true\n            end  \n            return true\n            \n        end\n    end\n    \n    return false\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
