					["glow_frame"] = "WeakAuras:(v) Slag Bomb Positions",
					["custom"] = "local bossHP = UnitExists(\"boss1\") and (UnitHealth(\"boss1\")/UnitHealthMax(\"boss1\")) or 1\n\nif bossHP < .65 then\n    positions ={\"Star\",\"Star\",\"Triangle\"};\nend\n\nif zgn == zgnWA() then markSpells__wait(timeDelay,maxDebuffCount,markSpells, spellID, positions, aura_env) end\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
