				["init"] = {
					["do_custom"] = true,
					["custom"] = "aura_env.Result = \"\"\n\nlocal positions ={\"Star\",\"Cross\",\"Triangle\"}; \nlocal spellID = 181099;\nlocal timeDelay = 1.5; --seconds\nlocal maxDebuffCount = 3; --trigger when 3 debuffs go out\n\nlocal waitTable = {};\nlocal waitFrame = nil;\n\nfunction markSpells__wait(delay,maxDebuffs,func, ...)\n    if(type(delay)~=\"number\" or type(func)~=\"function\") then\n        if zgnWA() == zgn then return false; end\n    end\n    if(waitFrame == nil) then\n        waitFrame = CreateFrame(\"Frame\",\"WaitFrame\", UIParent);\n        waitFrame:SetScript(\"onUpdate\",function (self,elapse)\n                local count = #waitTable;\n                local i = 1;\n                while(i<=count) do\n                    local waitRecord = tremove(waitTable,i);\n                    local _delay = tremove(waitRecord,1);\n                    local _maxDebuffs = tremove(waitRecord,1);\n                    local _func = tremove(waitRecord,1);\n                    local _params = tremove(waitRecord,1);\n                    local debuffCount = getDebuffCount(unpack(_params));\n                    if(_delay>elapse) and (debuffCount ~= _maxDebuffs) then\n                        tinsert(waitTable,i,{_delay-elapse,_maxDebuffs,_func,_params});\n                        if zgnWA() == zgn then  i = i + 1; end\n                    else\n                        if zgnWA() == zgn then count = count - 1; _func(unpack(_params)); end\n                        \n                    end\n                end\n        end);\n    end\n    if zgnWA() == zgn then  tinsert(waitTable,{delay,maxDebuffs,func,{...}}); end\n    return true;\nend\n\nfunction markSpells(spellID, positions, aura_env)\n    local count = 0;\n    local spellName = GetSpellInfo(spellID)\n    \n    for i=1,GetNumGroupMembers() do\n        local raider = \"raid\"..i\n        if UnitBuff(raider, spellName) then\n            if zgnWA() == zgn then count = count + 1 end\n            if UnitIsUnit(\"player\", raider) then\n                break\n            end\n        end\n    end\n    \n    if count > 0 then\n        SendChatMessage(spellName..\": {\"..positions[count]..\"} - \"..positions[count])\n        aura_env.Result = positions[count]\n    end\nend\n\nfunction getDebuffCount(spellID)\n    local count = 0;\n    local spellName = GetSpellInfo(spellID)\n    for i=1,GetNumGroupMembers() do\n        local raider = \"raid\"..i\n        if UnitBuff(raider, spellName) then\n            if zgnWA() == zgn  then count = count + 1; end\n        end\n    end\n    \n    return count\nend",
				},
