				["custom_hide"] = "custom",
				["custom"] = "function(event, ...)\n    \n    --@Author: Krazyito-Mal'ganis, US\n    --@Version: v1.2\n    \n    --This is your 'Options Menu'. Change these values to suit your needs.\n    \n    local interruptOrder = {\"Krazyito\", \"Stevejãbs\", \"Ragebar\", \"Tido\", \"Vannisshh\", \"Dymse\", \"Strevig\"} -- This is the order the rotation will go by. You MUST use their EXACT name, including realm if they are on a different realm No realm if on the same. Example: \"Krazyito-Mal'ganis.\n    local soundFile = \"AirHorn.ogg\" -- Edit this with the correct name of the sound file you want to use in the WEAK AURAS MEDIA FOLDER.\n    local hideAfterCombat = false -- this option lets you hide the list after combat.\n    \n    --Currently unused: local unitToInterrupt = \"target\" -- This is the unit your are interrupting. Make sure to use correct UnitID with quotation marks. (\"target\", \"focus\", boss1\" etc..)\n    \n    \n    --end of the 'Options Menu'\n    \n    local  _, _, _, raidSize = ... -- ENCOUNTER_START and ENCOUNTER_END variables.\n    local _, subevent, _, _, sourceName, _, _, _, destName, _, _, spellID, spellName= ... -- COMBAT_LOG_EVENT_UNFILTERED variables.\n    local fifteenSec, sixtySec, fortyFiveSec, twelveSec, twentyFourSec = 15, 60, 45, 12, 24 -- cooldowns of differing interrupts\n    \n    \n    local getClassInterrupt = function(playerName) -- returns the names of interrupts used by the specific unit's class.\n        local _, playerClass = UnitClass(playerName)\n        \n        if playerClass == \"DEATHKNIGHT\" then\n            return \"Mind Freeze\"\n        elseif playerClass == \"DRUID\" then\n            return \"Skull Bash\", \"Solar Beam\"\n        elseif playerClass == \"HUNTER\" then\n            return \"Counter Shot\"\n        elseif playerClass == \"MAGE\" then\n            return \"Counterspell\"\n        elseif playerClass == \"MONK\" then\n            return \"Spear Hand Strike\"\n        elseif playerClass == \"PALADIN\" then\n            return \"Rebuke\", \"Avenger's Shield\"\n        elseif playerClass == \"PRIEST\" then\n            return \"Silence\"\n        elseif playerClass == \"ROGUE\" then\n            return \"Kick\"\n        elseif playerClass == \"SHAMAN\" then\n            return \"Wind Shear\"\n        elseif playerClass == \"WARLOCK\" then\n            return \"Spell Lock\", \"Optical Blast\", \"Shadow Lock\"\n        elseif playerClass == \"WARRIOR\" then\n            return \"Pummel\"\n        else \n            return \"Not a player\"\n        end\n    end\n    \n    \n    if event == \"ENCOUNTER_START\" and raidSize >= 10 then -- Triggers at the start of the encounter as well as resets the list.\n        \n        WA_INTERRUPT_MANAGER_Trigger = 1\n        WA_INTERRUPT_MANAGER_List = interruptOrder\n        WA_INTERRUPT_MANAGER_Next = false\n        WA_INTERRUPT_MANAGER_encounterStart = true\n        \n        return true\n        \n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" and WA_INTERRUPT_MANAGER_encounterStart then -- Triggers every time a combat log event happens.\n        if subevent == \"SPELL_CAST_SUCCESS\" and sourceName == WA_INTERRUPT_MANAGER_List[1] then -- If the event was a successful spell cast as well as being the first person on the list.\n            \n            local primary, secondary, lockTerrorGuard =  getClassInterrupt(sourceName) -- Save interrupt name information\n            \n            if spellName == primary or spellName == secondary or spellName == lockTerrorGuard  then -- If spell name was an interrupt.\n                table.insert(WA_INTERRUPT_MANAGER_List, WA_INTERRUPT_MANAGER_List[1]) -- Put them at the bottom of the list\n                table.remove(WA_INTERRUPT_MANAGER_List, 1) -- Remove them from the top of the list.\n                \n                \n                \n                if WA_INTERRUPT_MANAGER_List[1] == UnitName(\"player\")then -- If the person now at the top of the list is the currect player\n                    WA_INTERRUPT_MANAGER_Next = true -- Trigger the 'NEXT' text.\n                    PlaySoundFile(\"\\\\Interface\\\\Addons\\\\WeakAuras\\\\Media\\Sounds\\\\\" .. soundFile) -- Play the sound File - BUGGED?\n                else\n                    WA_INTERRUPT_MANAGER_Next = false -- Make sure the 'NEXT' text is not displayed.\n                end\n            end\n        end\n        \n        \n    elseif event == \"ENCOUNTER_END\" then -- When an encounter ends, stop the timer and untrigger the aura.\n        \n        WA_INTERRUPT_MANAGER_encounterStart = false\n        if hideAfterCombat == true then\n            WA_INTERRUPT_MANAGER_Trigger = 0 -- Hides the list after the encounter ends\n        else\n            WA_INTERRUPT_MANAGER_Trigger = 1\n        end\n        \n        return false\n        \n    end\n    \nend",
