			},
			["displayText"] = "%c",
			["customText"] = "function()\n    --return TOTAL_DOTS\nend\n\n\n\n\n\n",
			["yOffset"] = 0,
			["regionType"] = "text",
			["activeTriggerMode"] = 0,
			["customTextUpdate"] = "update",
			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["do_custom"] = true,
					["custom"] = "aura_env.Moonfire = 164812\naura_env.Sunfire = 164815\naura_env.DOT_TRACKER = {}\naura_env.TOTAL_DOTS = 0\naura_env.PlayerGUID = UnitGUID(\"player\")\n\n\n\n\n",
