			},
			["justify"] = "LEFT",
			["selfPoint"] = "BOTTOM",
			["trigger"] = {
				["type"] = "custom",
				["custom_type"] = "event",
				["event"] = "Health",
				["unit"] = "player",
				["debuffType"] = "HELPFUL",
				["names"] = {
				},
				["spellIds"] = {
				},
				["subeventPrefix"] = "SPELL",
				["subeventSuffix"] = "_CAST_START",
				["events"] = "COMBAT_LOG_EVENT_UNFILTERED",
				["custom"] = "--totaldots\nfunction(event, ...)\n    local currentTime = GetTime();\n    \n    local totalMF = 0\n    local totalSF = 0\n    \n    local sourceGUID = select(4, ...) -- this only works for combat log event unfiltered, but its the only one we're importing anyway so yolo\n    local subevent =  select(2, ...)\n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" and (subevent == \"UNIT_DIED\" or subevent == \"UNIT_DESTROYED\" or subevent == \"SPELL_INSTAKILL\") then -- Unit Died, remove them from the target list.\n        aura_env.DOT_TRACKER[guid] = nil\n    end\n    \n    if UnitIsDeadOrGhost(\"player\") then -- We died, or, exited combat, go ahead and purge the list\n        aura_env.DOT_TRACKER = {}\n    end\n    \n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" and sourceGUID == aura_env.PlayerGUID then -- if the event was generated by the player\n        \n        local subevent = select(2, ...)\n        local destGUID = select(8, ...)\n        local spellid = select(12, ...)\n        \n        if subevent == \"SPELL_AURA_APPLIED\" or subevent == \"SPELL_PERIODIC_DAMAGE\" or subevent == \"SPELL_AURA_REFRESH\" then -- if this event was applied, periodic damage, refresh\n            if spellid == aura_env.Moonfire then -- if the spellid is moonfire\n                if not aura_env.DOT_TRACKER[destGUID] then -- if there is nothing in this index\n                    aura_env.DOT_TRACKER[destGUID] = {} -- make a table\n                end\n                aura_env.DOT_TRACKER[destGUID].MF = 1 -- we have moonfire\n                aura_env.DOT_TRACKER[destGUID].LastUpdate = currentTime\n            elseif spellid == aura_env.Sunfire then\n                if not aura_env.DOT_TRACKER[destGUID] then -- if there is nothing in this index\n                    aura_env.DOT_TRACKER[destGUID] = {} -- make a table\n                end\n                aura_env.DOT_TRACKER[destGUID].SF = 1 -- we have sunfire\n                aura_env.DOT_TRACKER[destGUID].LastUpdate = currentTime\n            end -- end spellid check                \n        end -- end SAA, SPD, SARe checks\n        \n        if subevent == \"SPELL_AURA_REMOVED\" or subevent == \"SPELL_DISPEL\" then -- if aura was removed\n            if spellid == aura_env.Moonfire then\n                if aura_env.DOT_TRACKER[destGUID] then\n                    aura_env.DOT_TRACKER[destGUID].MF = nil -- we have moonfire\n                    aura_env.DOT_TRACKER[destGUID].LastUpdate = currentTime\n                end\n            elseif spellid == aura_envSunfire then\n                if aura_env.DOT_TRACKER[destGUID] then\n                    aura_env.DOT_TRACKER[destGUID].SF = nil -- we have moonfire\n                    aura_env.DOT_TRACKER[destGUID].LastUpdate = currentTime\n                end\n            end -- end spellid check\n        end--end dot removal check\n        \n        for guid, tbl in pairs(aura_env.DOT_TRACKER) do\n            \n            if not tbl.LastUpdate then\n                aura_env.DOT_TRACKER[guid] = nil\n                \n            elseif currentTime - tbl.LastUpdate > 3 then -- if lastupdate is not nil and less than 3s\n                aura_env.DOT_TRACKER[guid] = nil\n            end -- end if time is too long\n            \n            if not tbl.MF and not tbl.SF then \n                aura_env.DOT_TRACKER[guid] = nil\n            end\n            \n            if tbl.MF then\n                totalMF = totalMF + 1\n            end\n            \n            if tbl.SF then\n                totalSF = totalSF + 1\n            end\n        end -- end for loop of dot tracker\n        aura_env.TOTAL_DOTS = totalMF + totalSF\n        WeakAuras.ScanEvents(\"BALANCE_TOTAL_DOTS\", totalMF, totalSF)\n        \n    end-- end CLEU and source guid check\nend",
