			},
			["displayText"] = "%c",
			["customText"] = "--Display\nfunction()\n    \n    \n    -- 131113 - Glyph of the Cheetah\n    -- 146655 - Glyph of Untamed Stars\n    \n    \n    local returnString = \"\"\n    \n    \n    \n    if aura_env.cheetah then\n        local _, _, icon = GetSpellInfo(131113)\n        \n        returnString = returnString .. \"|T\" .. icon .. \":16|t\"\n    end\n    \n    if aura_env.stars then\n        local _, _, icon = GetSpellInfo(146655)\n        \n        returnString = returnString .. \"|T\" .. icon .. \":16|t\"\n    end\n    \n    return returnString\n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
