				["unit"] = "player",
				["custom_type"] = "status",
				["custom"] = "--Trigger\nfunction()\n    \n    \n    \n    aura_env.glyphsMinor = {}\n    \n    \n    for i = 1,6 do\n        local enabled, glyphType, glyphTooltipIndex, glyphSpell, icon = GetGlyphSocketInfo(i, GetActiveSpecGroup())\n        if glyphType == 1 then\n            table.insert(aura_env.glyphsMinor, glyphSpell)\n        end\n        \n        \n    end\n    \n    -- 131113 - Glyph of the Cheetah\n    -- 146655 - Glyph of Untamed Stars\n    \n    aura_env.cheetah = false\n    aura_env.stars = false\n    \n    \n    for i,v in ipairs(aura_env.glyphsMinor) do\n        if v == 131113 then -- if Glyph of Cheetah is active\n            aura_env.cheetah = true\n        elseif v == 146655 then --if Glyph of untamed stars is active\n            aura_env.stars = true\n        end\n        \n    end\n    \n    \n    \n    return true\n    \n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
