		["Raid HUD for WeakAuras"] = {
			["outline"] = true,
			["fontSize"] = 12,
			["color"] = {
				1, -- [1]
				1, -- [2]
				1, -- [3]
				1, -- [4]
			},
			["displayText"] = "%c",
			["customText"] = "function()\nend",
			["yOffset"] = 0,
			["regionType"] = "text",
			["activeTriggerMode"] = 0,
			["customTextUpdate"] = "event",
			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["do_custom"] = true,
					["custom"] = "-- Raid Head-Up Display for WeakAuras\nlocal core = WA_RaidHUD or CreateFrame(\"Frame\", \"WA_RaidHUD\", UIParent)\n\ncore.db = {\n    scale = 8,\n    maxRange = 60,\n    x = 0,\n    y = 0,\n    showParty = false,\n}\n\ncore.pxRange = core.db.maxRange * core.db.scale\ncore.pxRange2 = core.pxRange * core.pxRange\ncore.defaultScale = core.db.scale\nif core.didInit then\n    return core:SetPoint(\"CENTER\", core.db.x, core.db.y)\nend\n\n\nlocal UnitGUID, GetUnitName, UnitIsUnit, UnitPosition, GetPlayerFacing, UnitClass, UnitIsGhost, UnitIsDeadOrGhost, UnitIsConnected, GetNumGroupMembers, IsInRaid, IsInGroup =\nUnitGUID, GetUnitName, UnitIsUnit, UnitPosition, GetPlayerFacing, UnitClass, UnitIsGhost, UnitIsDeadOrGhost, UnitIsConnected, GetNumGroupMembers, IsInRaid, IsInGroup\nlocal type, unpack, pairs, setmetatable, getmetatable, smatch, sqrt, sin, cos, min, msin, mcos, mmodf, _ =\ntype, unpack, pairs, setmetatable, getmetatable, string.match, sqrt, sin, cos, min, math.sin, math.cos, math.modf\n\ncore.roster, core.nameRoster, core.positions, core.displayedUnits  = {}, {}, {}, {}\ncore.HUDpositions, core.HUDpositions, core.toShow = {}, { player = {0, 0, true} }, {}\n\ncore.facing, core.sin, core.cos = 0, 0, 1\ncore.playerName = GetUnitName(\"player\", true)\nlocal COMM_MSG = \"WA_RAID_HUD_MSG\"\n\ncore:SetPoint(\"CENTER\", core.db.x, core.db.y)\ncore:SetSize(core.pxRange * 2, core.pxRange * 2)\ncore:SetFrameStrata(\"BACKGROUND\")\ncore:Hide()\n\ncore.arrow = CreateFrame(\"Frame\", nil, core)\ncore.arrow:SetFrameStrata(\"LOW\")\ncore.arrow:SetPoint(\"CENTER\")\ncore.arrow:SetSize(26, 26)\ncore.arrow.t = core.arrow:CreateTexture(nil, \"BORDER\")\ncore.arrow.t:SetAllPoints()\ncore.arrow.t:SetTexture([[Interface\\MINIMAP\\MiniMap-DeadArrow]])\ncore.arrowring = core:CreateTexture(nil, \"BACKGROUND\", nil, 3)\ncore.arrowring:SetPoint(\"CENTER\")\ncore.arrowring:SetSize(48,48)\ncore.arrowring:SetTexture([[Interface\\COMMON\\portrait-ring-withbg-highlight]])\n\n\n----------------------------------------\n-- Blips\n\nlocal BLIP_TEX_COORDS = {\n    [\"WARRIOR\"] = { 0, 0.125, 0, 0.25 },\n    [\"PALADIN\"] = { 0.125, 0.25, 0, 0.25 },\n    [\"HUNTER\"] = { 0.25, 0.375, 0, 0.25 },\n    [\"ROGUE\"] = { 0.375, 0.5, 0, 0.25 },\n    [\"PRIEST\"] = { 0.5, 0.625, 0, 0.25 },\n    [\"DEATHKNIGHT\"] = { 0.625, 0.75, 0, 0.25 },\n    [\"SHAMAN\"] = { 0.75, 0.875, 0, 0.25 },\n    [\"MAGE\"] = { 0.875, 1, 0, 0.25 },\n    [\"WARLOCK\"] = { 0, 0.125, 0.25, 0.5 },\n    [\"DRUID\"] = { 0.25, 0.375, 0.25, 0.5 },\n    [\"MONK\"] = { 0.125, 0.25, 0.25, 0.5 }\n}\n\ncore.newBlip = {\n    __index = function(t, k)\n        if k == \"player\" then return end\n        local blip = CreateFrame(\"Frame\", nil, core)\n        t[k] = blip\n        blip:SetPoint(\"CENTER\")\n        blip:SetFrameStrata(\"LOW\")\n        blip:SetFrameLevel(1)\n        blip:SetSize(22,22)\n        blip.t = blip:CreateTexture(nil, \"BACKGROUND\", nil, 4)\n        blip.t:SetAllPoints()        \n        blip.t:SetTexture([[Interface\\MINIMAP\\PartyRaidBlips]])\n        blip.t:SetTexCoord(.5, .625, .5, .75)\n        \n        return blip\n    end\n}\ncore.blips = setmetatable({}, core.newBlip)\n\nfunction core:InitBlip(unit)\n    if UnitIsUnit(unit, \"player\") then\n        return\n    end\n    \n    local blip = core.blips[unit]\n    local _, class = UnitClass(unit)\n    if BLIP_TEX_COORDS[class] then\n        blip.t:SetTexCoord(unpack(BLIP_TEX_COORDS[class]))\n    else\n        blip.t:SetTexCoord(.5, .625, .5, .75)\n    end\nend\n\nfunction core:UpdateBlip(unit)\n    local blip = core.blips[unit]\n    local p = core.positions[unit]\n    \n    local x, y, inRange = core:GetHUDposition(unpack(p))\n    core.HUDpositions[unit] = core.HUDpositions[unit] or {}\n    core.HUDpositions[unit][1] = x\n    core.HUDpositions[unit][2] = y\n    core.HUDpositions[unit][3] = inRange\n    \n    if inRange then\n        core.displayedUnits[unit] = true\n        blip:SetPoint(\"CENTER\", x, y)\n        blip:Show()\n    else\n        core.displayedUnits[unit] = false\n        blip:Hide()\n    end\nend\n\n\n----------------------------------------\n-- Data handling\n\nfunction core:UpdateRoster()\n    wipe(core.roster)\n    wipe(core.nameRoster)\n    wipe(core.positions)\n    wipe(core.displayedUnits)\n    wipe(core.HUDpositions)\n    \n    if IsInRaid() then\n        for i = 1, GetNumGroupMembers() do\n            local unit = WeakAuras.raidUnits[i]\n            if UnitIsUnit(unit, \"player\") then\n                unit = \"player\"\n                core.HUDpositions.player = {0, 0, true}\n            elseif ( UnitIsConnected(unit) and not UnitIsDeadOrGhost(unit) ) then\n                core.displayedUnits[unit] = false\n                core:InitBlip(unit)\n            end\n            core.roster[UnitGUID(unit)] = unit\n            core.nameRoster[GetUnitName(unit, true)] = unit\n        end\n        \n        for unit, blip in pairs(core.blips) do\n            if core.displayedUnits[unit] == nil then\n                blip:Hide()\n            end\n        end\n    elseif IsInGroup() and core.db.showParty then\n        for i = 1, GetNumGroupMembers() - 1 do\n            local unit = WeakAuras.partyUnits[i]\n            core.roster[UnitGUID(unit)] = unit\n            core.nameRoster[GetUnitName(unit, true)] = unit\n            \n            if ( UnitIsConnected(unit) and not UnitIsDeadOrGhost(unit) ) then\n                core.displayedUnits[unit] = false\n                core:initBlip(unit)\n            end\n        end\n        core.roster[core.playerGUID] = \"player\"\n        core.nameRoster[core.playerName] = \"player\"\n        core.HUDpositions.player = {0, 0, true}\n        \n        for unit, blip in pairs(core.blips) do\n            if core.displayedUnits[unit] == nil then\n                blip:Hide()\n            end\n        end\n    end\nend\n\nfunction core:UpdatePositions()\n    core.positions.player = core.positions.player or {}\n    core.positions.player[2], core.positions.player[1], _, core.positions.player[3] = UnitPosition(\"player\")\n    for unit in pairs(core.displayedUnits) do\n        core.positions[unit] = core.positions[unit] or {}\n        core.positions[unit][2], core.positions[unit][1], _, core.positions[unit][3] = UnitPosition(unit)\n    end\nend\n\nfunction core:GetHUDposition(x, y, map)\n    local p = core.positions.player\n    if map == p[3] then\n        local offx, offy = (p[1] - x) * core.db.scale, (y - p[2]) * core.db.scale    -- flip x direction\n        \n        return core.cos * offx + core.sin * offy, -core.sin * offx + core.cos * offy, offx*offx + offy*offy <= core.pxRange2\n    end\nend\n\nfunction core:GetUnitHUDposition(unit)\n    local t = core.HUDpositions[unit]\n    if t then\n        return unpack(t)\n    else\n        return core.positions[unit] and core:GetHUDposition(unpack(core.positions[unit]))\n    end\nend\n\nfunction core:SetMemberValidity(unit)\n    if unit == \"player\" then\n        return\n    elseif ( UnitIsConnected(unit) and not UnitIsDeadOrGhost(unit) ) then\n        core.displayedUnits[unit] = false\n    else\n        core.displayedUnits[unit] = nil\n    end\n    return core:InitBlip(unit)\nend\n\n\n\n----------------------------------------\n-- Enable / Disable , Visibility\n\nfunction core:EnableTest()\n    if IsInRaid() or ( IsInGroup() and core.db.showParty ) then\n        return core:Enable()\n    else\n        return core:Disable()\n    end\nend\n\nfunction core:Enable()\n    if not core.enabled and not core.forceDisable then\n        core.enabled = true\n        \n        WeakAuras.ScanEvents(COMM_MSG, \"enabled\")\n        core:CheckVisibility()\n    end\nend\n\nfunction core:Disable()\n    if core.enabled then\n        core.enabled = false\n        \n        WeakAuras.ScanEvents(COMM_MSG, \"disabled\")\n        core.toShow.core = nil\n        return core:CheckVisibility()\n    end\nend\n\nfunction core:Request2Show(modName, show, scale)\n    if show and not core.toShow[modName] then\n        core.toShow[modName] = true\n        if scale and not core.scaleOverride then\n            core.scaleOverride = modName\n            core.db.scale = scale\n        end\n        if not core.isShown then\n            return core:CheckVisibility()\n        end\n    elseif not show and core.toShow[modName] then\n        core.toShow[modName] = nil\n        if core.scaleOverride == modName then\n            core.scaleOverride = nil\n            core.db.scale = core.defaultScale\n        end\n        if core.isShown and not next(core.toShow) then\n            return core:CheckVisibility()\n        end\n    end\nend\n\nfunction core:CheckVisibility()\n    if core.enabled and next(core.toShow) and core.playerValid then\n        if not core.isShown then\n            core.isShown = true\n            \n            for guid, unit in pairs(core.roster) do\n                core:SetMemberValidity(unit)\n            end\n            core:Updater()\n            \n            core:RegisterEvent(\"UNIT_HEALTH\")\n            core:RegisterEvent(\"UNIT_CONNECTION\")\n            core:SetScript(\"OnUpdate\", core.Updater)\n            \n            core:Show()\n        end\n    else\n        if core.isShown then\n            core.isShown = nil\n            \n            core:UnregisterEvent(\"UNIT_HEALTH\")\n            core:UnregisterEvent(\"UNIT_CONNECTION\")\n            core:SetScript(\"OnUpdate\", nil)\n            \n            core:Hide()\n        end\n    end\nend\n\n----------------------------------------\n-- OnUpdate / Event Handlers\n\nfunction core:Updater()\n    core.facing = GetPlayerFacing()\n    core.sin = msin(core.facing)\n    core.cos = mcos(core.facing)\n    \n    core:UpdatePositions()\n    for unit in pairs(core.displayedUnits) do\n        core:UpdateBlip(unit)\n    end\nend\n\nfunction core:PLAYER_ENTERING_WORLD()\n    core.playerGUID = UnitGUID(\"player\")\n    core.playerValid = not UnitIsGhost(\"player\")\n    core:StandBy()\nend\n\nfunction core:GROUP_ROSTER_UPDATE()\n    core:UpdateRoster()\n    return core:EnableTest()\nend\n\nfunction core:UNIT_NAME_UPDATE(unit)\n    if core.displayedUnits[unit] ~= nil then\n        return core:InitBlip(unit)\n    end\nend\n\nfunction core:PLAYER_ALIVE()\n    local isGhost = UnitIsGhost(\"player\")\n    if isGhost and core.playerValid then\n        core.playerValid = nil\n        return core:EnableTest()\n    elseif not isGhost and not core.playerValid then\n        core.playerValid = true\n        return core:EnableTest()\n    end\nend\n\nfunction core:PLAYER_UNGHOST()\n    core.playerValid = true\n    return core:EnableTest()\nend\n\nfunction core:UNIT_HEALTH(unit)\n    if IsInRaid() and smatch(unit, \"raid%d+\") == unit then\n        return core:SetMemberValidity(unit)\n    elseif IsInGroup() and core.db.showParty and smatch(unit, \"party%d\") == unit then\n        return core:SetMemberValidity(unit)\n    end\nend\n\nfunction core:UNIT_CONNECTION(unit)\n    if IsInRaid() and smatch(unit, \"raid%d+\") == unit then\n        return core:SetMemberValidity(unit)\n    elseif IsInGroup() and core.db.showParty and smatch(unit, \"party%d\") == unit then\n        return core:SetMemberValidity(unit)\n    end\nend\n\nfunction core:StandBy()\n    core:RegisterEvent(\"GROUP_ROSTER_UPDATE\")\n    core:RegisterEvent(\"UNIT_NAME_UPDATE\")\n    core:RegisterEvent(\"PLAYER_ALIVE\")\n    core:RegisterEvent(\"PLAYER_UNGHOST\")\nend\n\nfunction core:AtEase()\n    core:Disable()\n    core:UnregisterAllEvents()\nend\n\nfunction core:On()\n    if core.forceDisable then\n        core.forceDisable = nil\n        core:StandBy()\n        core:GROUP_ROSTER_UPDATE()\n        core.playerValid = not UnitIsGhost(\"player\")\n        DEFAULT_CHAT_FRAME:AddMessage(\"WA Raid HUD Enabled\", 0, 1, 0)\n    end\nend\n\nfunction core:Off()\n    if not core.forceDisable then\n        core.forceDisable = true\n        core:AtEase()\n        DEFAULT_CHAT_FRAME:AddMessage(\"WA Raid HUD Disabled\", 1, 1, 0)\n    end\nend\n\ncore:SetScript(\"OnEvent\", function(self, event, ...)\n        if core[event] then\n            core[event](core, ...)\n        end\nend)\n\ncore:RegisterEvent(\"PLAYER_ENTERING_WORLD\")\ncore.didInit = true\n\n----------------------------------------\n-- Utility features for Modules\n\n-- API\n\nfunction core:GetDistance(unit1, unit2)\n    local p1, p2 = core.positions[unit1], core.positions[unit2]\n    if p1 and p2 and core.isShown then\n        if p1[3] == p2[3] then\n            local dx, dy = p2[1] - p1[1], p2[2] - p1[2]\n            return sqrt(dx * dx + dy * dy)\n        end\n    end\n    \n    local y1, x1, _, map1 = UnitPosition(unit1)\n    local y2, x2, _, map2 = UnitPosition(unit2)\n    if map1 and map2 and map1 == map2 then\n        local dx, dy = x2 - x1, y2 - y1\n        return sqrt(dx * dx + dy * dy)\n    end\nend\n\nfunction core:GetInRangeMembers(ref, range)\n    if not range then return end\n    local x0, y0, map0, isUnit\n    if core.positions[ref] and core.isShown then\n        isUnit = true\n        x0, y0, map0 = unpack(core.positions[ref])\n    elseif type(ref) == \"table\" then\n        x0, y0, map0 = unpack(ref)\n    end\n    if not map0 then return end\n    local num = isUnit and -1 or 0\n    for unit, t in pairs(core.positions) do\n        local dist = core:GetDistance(ref, unit)\n        if dist and dist <= range then\n            num = num + 1\n        end\n    end\n    return num\nend\n\n-- Objects\n\nlocal Stex = [[Interface\\AddOns\\WeakAuras\\Media\\Textures\\Square_White]]\nlocal Ctex = [[Interface\\AddOns\\WeakAuras\\Media\\Textures\\Circle_White]]\nlocal tCoeff = 256/254\n\n-- OnUpdate func. for object sticking\nlocal function ConvertStickTarget(stickTo)\n    if not stickTo then return end\n    if core.roster[stickTo] then\n        return \"guid\", core:GetUnitHUDposition(core.roster[stickTo])\n    elseif type(stickTo) == \"table\" and type(stickTo[1]) == \"number\" then\n        return \"map\", core:GetHUDposition(unpack(stickTo))\n    elseif type(stickTo) == \"table\" and getmetatable(stickTo) then\n        return \"object\", stickTo\n    end\nend\n\nlocal function stickyUpdate(self)\n    if not self.stickTo then return end\n    \n    local Type, x, y, inRange = ConvertStickTarget(self.stickTo)\n    if Type == \"guid\" or Type == \"map\" then\n        if inRange then\n            self:SetPoint(\"CENTER\", core, \"CENTER\", x, y)\n            self:Show()\n        else\n            self:Hide()\n        end\n    elseif Type == \"object\" then\n        if x:IsVisible() then\n            self:Show()\n        else\n            self:Hide()\n        end\n    end\nend\n\nlocal function lineStickyUpdate(self)\n    if not self.stickTo1 or not self.stickTo2 then return end\n    local Type1, x1, y1 = ConvertStickTarget(self.stickTo1)\n    local Type2, x2, y2 = ConvertStickTarget(self.stickTo2)\n    if y1 and y2 then\n        self:Draw(x1, y1, x2, y2)\n    else\n        self:SetScript(\"OnUpdate\", nil)\n        self:Draw(0,0,0,0)\n    end\nend\n\n-- line\nlocal lineCoeff = tCoeff / 2\ncore.lineCache = {}\n\n-- http://mathworld.wolfram.com/Circle-LineIntersection.html\nfunction core:CLInter(x1, y1, x2, y2, r2)\n    r2 = r2 or core.pxRange2\n    local dx, dy = x2 - x1, y2 - y1\n    local dr2 = dx * dx + dy * dy\n    local D = x1 * y2 - x2 * y1\n    local Det = r2 * dr2 - D * D\n    if Det > 0 then\n        local det = dy < 0 and -sqrt(Det) or sqrt(Det)\n        return (D * dy + dx * det)/dr2, (-D * dx + dy * det)/dr2, (D * dy - dx * det)/dr2, (-D * dx - dy * det)/dr2\n    end\nend\n\nlocal lineDummyFrame = CreateFrame(\"Frame\")\nlocal lineMT = {__index = lineDummyFrame}\nlocal linePrototype = {\n    Draw = function(this, sx, sy, ex, ey, w, extend)\n        w = w or this.w or 8\n        extend = extend or this.extend\n        local T = this.t\n        this.sx, this.sy, this.ex, this.ey, this.w, this.extend = sx, sy, ex, ey, w, extend\n        \n        local inRange1, inRange2 = sx * sx + sy * sy <= core.pxRange2, ex * ex + ey * ey <= core.pxRange2\n        if (not inRange1) or (not inRange2) or (extend ~= 0) then\n            local x3, y3, x4, y4 = core:CLInter(sx, sy, ex, ey, core.pxRange2)\n            \n            if x3 then\n                local dx, dy = ex - sx, ey - sy\n                local p3Same = dx * (x3 - sx) + dy * (y3 - sy) > 0\n                if extend == 0 then    -- line segment\n                    if inRange1 then    -- not inRange2\n                        if p3Same then\n                            ex, ey = x3, y3\n                        else\n                            ex, ey = x4, y4\n                        end\n                    elseif inRange2 then\n                        if -dx*(x3-ex)-dy*(y3-ey) > 0 then\n                            sx, sy = x3, y3\n                        else\n                            sx, sy = x4, y4\n                        end\n                    else\n                        ex, ey = sx, sy\n                    end\n                elseif extend == 1 then    -- half-line\n                    if inRange1 then\n                        if p3Same then\n                            ex, ey = x3, y3\n                        else\n                            ex, ey = x4, y4\n                        end\n                    else\n                        if p3Same then\n                            sx, sy, ex, ey = x3, y3, x4, y4\n                        else\n                            ex, ey = sx, sy\n                        end\n                    end\n                else    -- line\n                    sx, sy, ex, ey = x3, y3, x4, y4\n                end\n            else\n                ex, ey = sx, sy\n            end\n        end\n        \n        local dx, dy, cx, cy = ex - sx, ey - sy, (sx + ex) / 2, (sy + ey) / 2\n        if dx < 0 then\n            dx, dy = -dx, -dy\n        end\n        \n        local l = sqrt((dx * dx) + (dy * dy))\n        if l == 0 then\n            T:SetTexCoord(0,0,0,0,0,0,0,0)\n            this:ClearAllPoints()\n            this:SetPoint(\"BOTTOMLEFT\", core, \"CENTER\", cx, cy)\n            this:SetPoint(\"TOPRIGHT\", core, \"CENTER\", cx, cy)\n            return\n        end\n        \n        local s, c = -dy / l, dx / l\n        local sc = s * c\n        \n        local Bwid, Bhgt, BLx, BLy, TLx, TLy, TRx, TRy, BRx, BRy;\n        if (dy >= 0) then\n            Bwid = ((l * c) - (w * s)) * lineCoeff\n            Bhgt = ((w * c) - (l * s)) * lineCoeff\n            BLx, BLy, BRy = (w / l) * sc, s * s, (l / w) * sc;\n            BRx, TLx, TLy, TRx = 1 - BLy, BLy, 1 - BRy, 1 - BLx; \n            TRy = BRx;\n        else\n            Bwid = ((l * c) + (w * s)) * lineCoeff\n            Bhgt = ((w * c) + (l * s)) * lineCoeff\n            BLx, BLy, BRx = s * s, -(l / w) * sc, 1 + (w / l) * sc;\n            BRy, TLx, TLy, TRy = BLx, 1 - BRx, 1 - BLx, 1 - BLy;\n            TRx = TLy;\n        end\n        \n        T:SetTexCoord(TLx, TLy, BLx, BLy, TRx, TRy, BRx, BRy)\n        this:ClearAllPoints()\n        this:SetPoint(\"BOTTOMLEFT\", core, \"CENTER\", cx - Bwid, cy - Bhgt)\n        this:SetPoint(\"TOPRIGHT\", core, \"CENTER\", cx + Bwid, cy + Bhgt)\n    end,\n    \n    Color = function(this, r, g, b, a)\n        this.t:SetVertexColor(r, g, b, a)\n    end,\n    \n    Width = function(this, w)\n        return this:Draw(this.sx, this.sy, this.ex, this.ey, w)\n    end,\n    \n    Stick = function(this, stickTo1, stickTo2)\n        this.stickTo1, this.stickTo2 = stickTo1, stickTo2\n        local Type1, Type2 = ConvertStickTarget(stickTo1), ConvertStickTarget(stickTo2)\n        if (Type1 == \"guid\" or Type1 == \"map\") and (Type2 == \"guid\" or Type2 == \"map\") then\n            this:SetScript(\"OnUpdate\", lineStickyUpdate)\n        else\n            this:SetScript(\"OnUpdate\", nil)\n        end\n    end,\n    \n    Free = function(this)\n        this:SetScript(\"OnUpdate\", nil)\n        this:Cl