		["Archimonde - Mark of the Legion - hamsda"] = {
			["xOffset"] = 0,
			["customText"] = "function()\n    if aura_env.position then\n        return string.format(\"\\124TInterface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_%d:%d\\124t\", aura_env.position, 16)\n    end\n    return \"dummy\"\nend",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["activeTriggerMode"] = 0,
			["customTextUpdate"] = "update",
			["actions"] = {
				["start"] = {
					["do_custom"] = true,
					["custom"] = "local getUnitPos = function(unit)\n    --1 = melee\n    --2 = ranged\n    local _, class = UnitClass(unit)\n    if (class == \"WARRIOR\" or class == \"ROGUE\" or class == \"DEATHKNIGHT\" or class == \"MONK\") then\n        return 1\n    elseif (class == \"HUNTER\" or class == \"PRIEST\" or class == \"MAGE\" or class == \"WARLOCK\") then\n        return 2\n    else --paladin, shaman, druid\n        local maxMana = UnitPowerMax(unit, SPELL_POWER_MANA)\n        if maxMana == 32000 then\n            return 1\n        else\n            return 2\n        end\n    end\nend\n\nlocal marks = {}\nlocal freePlayers = {}\nfor i=1, GetNumGroupMembers() do\n    local name, _, _, _, _, _, zone, online, isDead = GetRaidRosterInfo(i)\n    if zone == GetZoneText() then\n        local free = true\n        if isDead then --alive\n            free = false\n        end\n        if not online then\n            free = false\n        end\n        if UnitDebuff(name, GetSpellInfo(aura_env.spellID)) then\n            table.insert(marks, name)\n            free = false\n        end\n        if free then\n            table.insert(freePlayers, name)\n        end\n    end\nend\ntable.sort(marks)\ntable.sort(freePlayers)\n\nlocal markPos = {}\nfor i=1, aura_env.numMarks do\n    local cur = marks[i]\n    local start, stop, step = 1, aura_env.numMarks, 1\n    if getUnitPos(cur) == 2 then\n        start, stop, step = aura_env.numMarks, 1, -1\n    end\n    for j=start, stop, step do\n        if not markPos[j] then\n            markPos[j] = cur\n            if UnitName(\"player\") == cur then\n                aura_env.position = j\n            end\n            break\n        end\n    end\nend\n\nlocal numFree = table.getn(freePlayers) \nlocal base, extra = floor(numFree/aura_env.numMarks), numFree%aura_env.numMarks\nlocal posCounter, posMax = {0, 0, 0, 0}, {}\nfor i=1, aura_env.numMarks do\n    if extra > 0 then\n        posMax[i] = base + 1\n        extra = extra - 1\n    else\n        posMax[i] = base\n    end\nend\nfor i=1, numFree do\n    local cur = freePlayers[i]\n    local start, stop, step = 1, aura_env.numMarks, 1\n    if getUnitPos(cur) == 2 then\n        start, stop, step = aura_env.numMarks, 1, -1\n    end\n    for j=start, stop, step do\n        if posCounter[j] < posMax[j] then\n            posCounter[j] = posCounter[j] + 1\n            if UnitName(\"player\") == cur then\n                aura_env.position = j\n            end\n            break\n        end\n    end\nend",
				},
