				["custom"] = "function(event, timestamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags,  spellid, spellName)\n    \n    if event == \"ENCOUNTER_START\" then -- reset everything\n        aura_env.lastConduit = GetTime()\n        aura_env.conduitCount = 0\n    end\n    \n    local SPELL =\"Dark Conduit\" \n    --local SPELL = \"Healing Touch\"\n    \n    local conduitTime = {120, 90, 60, 30}\n    -- local conduitTime = {20, 20, 20, 20}\n    \n    \n    if subevent == \"SPELL_CAST_SUCCESS\" and spellName == SPELL then -- if dark conduit has been cast (first one will not have notification)\n        aura_env.lastConduit = GetTime()\n        aura_env.conduitCount = aura_env.conduitCount + 1\n    end\n    \n    local timeSinceLastConduit = GetTime() - aura_env.lastConduit -- counts up since last conduit cast\n    local whenToAlert = -1\n    \n    if aura_env.conduitCount ~= 0 then \n        whenToAlert = conduitTime[aura_env.conduitCount] - 8  -- conduit CD - 8, should alert 8~ seconds before\n    end\n    \n    \n    if timeSinceLastConduit >= whenToAlert and whenToAlert > 0 and not aura_env.triggered then --if (CurrTime - LastTime) is greater than (cooldown - 8) then show\n        return true        \n    end\n    \n    \n    \n    \n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n",
