		["Shackeld Torment Mythic Archimonde - colors/name list"] = {
			["outline"] = true,
			["fontSize"] = 25,
			["color"] = {
				1, -- [1]
				1, -- [2]
				1, -- [3]
				1, -- [4]
			},
			["displayText"] = "%c",
			["customText"] = "-- display code Shackle\nfunction()\n    \n    if not WeakAuras.IsOptionsOpen() then\n        \n        aura_env.list = \"\" -- display list reset\n        \n        for k,v in pairs(aura_env.playerInfo) do -- for every player with shackle\n            \n            --Find all players in range of this current player and closest distance\n            local InRange = {} -- empy string to find players near the soul\n            local closestPlayerDis = 100 -- arbitraty high value that acts as a 'reset' point (it will always get reset to a lower value)\n            for i=1, GetNumGroupMembers() do -- for each member in the group\n                local raider = \"raid\"..i\n                local currPosX, currPosY = UnitPosition(raider) -- get the current position of this raider\n                \n                if closestPlayerDis > (aura_env.DistanceBetweenPoints(v.X, v.Y, currPosX, currPosY)) then -- check if they are the closest person to the soul\n                    closestPlayerDis = aura_env.DistanceBetweenPoints(v.X, v.Y, currPosX, currPosY)\n                end\n                \n                if aura_env.DistanceBetweenPoints(v.X, v.Y, currPosX, currPosY) <= 25 then  --if within range of player add to list\n                    local name = UnitName(raider)\n                    if name ~= v.NAME then\n                        table.insert(InRange, name)\n                    end\n                end\n            end\n            \n            -- String Manipulation for finding who is near the soul.\n            --------\n            local InRangeString\n            \n            if next(InRange) == nil then -- if no players in range\n                InRangeString = \"GJ TEAM!\"\n            elseif #InRange >= 5 then -- if more than 5 players in range\n                InRangeString = \"5+\"\n            else -- show players in range\n                InRangeString = table.concat(InRange, \", \")\n            end\n            -----------------\n            \n            -- Coloring Stuff\n            ---------\n            local cName = aura_env.colorString(\"ffff00\", v.NAME) -- Color name yellow\n            \n            \n            local CPD = string.format(\"%d\", closestPlayerDis) -- make distance into short string\n            local cCPD = aura_env.colorString(\"ffff00\", CPD) -- color string yellow\n            \n            \n            local D2P = aura_env.DistanceToPoint(v.X, v.Y) -- save distance as number\n            local cD2P = string.format(\"%d\", D2P) -- save distance as short string\n            if D2P >= 25 then -- color green if more than 30\n                cD2P = aura_env.colorString(\"00ff00\", cD2P) \n            else -- color red\n                cD2P = aura_env.colorString(\"ff0000\", cD2P)\n            end\n            \n            \n            if InRangeString == \"GJ TEAM!\" then -- color green if GJ\n                InRangeString = aura_env.colorString(\"00ff00\", InRangeString) \n            elseif  InRangeString ~= nil then -- color red\n                InRangeString = aura_env.colorString(\"ff0000\", InRangeString) \n            end\n            ---------\n            \n            local info = string.format(\"%s - %s - %s - %s\", cName, cCPD, cD2P, InRangeString) -- construct the string into one string.\n            aura_env.list = aura_env.list .. info .. \"\\n\" -- add it to the 'list' as a new line seperated string.\n        end\n        \n        return aura_env.list -- show the 'list'\n    else\n        return \"Player - 0 - 0 - Player Names\" -- if the options are open show test case.\n    end\n    \nend",
			["yOffset"] = 54.701416015625,
			["anchorPoint"] = "CENTER",
			["activeTriggerMode"] = 0,
			["customTextUpdate"] = "update",
			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["do_custom"] = true,
					["custom"] = "--Init code Shackle\naura_env.ShackleCount = 0\naura_env.list = \"\"\naura_env.playerInfo = {}\n\n\n--------------------------------------------------------------------\n\n-- DistanceToPoint(200, 500) - Get the distance (in yards) between the player and the point 200,500.\n-- DistanceToPoint(UnitPosition('party4')) - Get the distance between player and the fourth party member of the player.\n-- @x number - x-coordinate\n-- @y number - y-coordinate\n-- return number - Distance (in yards) between player and specified point.\naura_env.DistanceToPoint = function(x, y)\n    local playerX, playerY = UnitPosition('player')\n    if x and y and playerX and playerY then\n        local dx = playerX - x\n        local dy = playerY - y\n        return (dx * dx + dy * dy) ^ 0.5\n    end\nend\n\n\n----\n\n-- DistanceBetweenPoints(100, 200, 500, 1200) - Get the distance (in yards) the points 100,200 and 500,1200\n-- DistanceBetweenPoints(UnitPosition('raid3'), UnitPosition('player')) - Get the distance between the player and the 'raid3' unit\n-- @ax number - Point A x-coordinate\n-- @ay number - Point A y-coordinate\n-- @bx number - Point B x-coordinate\n-- @by number - Point B y-coordinate\n-- return number - Distance (in yards) between both points.\naura_env.DistanceBetweenPoints = function(ax, ay, bx, by)\n    if ax and ay and by and by then\n        local dx = ax - bx\n        local dy = ay - by\n        return (dx * dx + dy * dy) ^ 0.5\n    end\n    return nil\nend\n\n---- \n\n--Custom funtion to color strings easier.\naura_env.colorString = function(hex, string)\n    \n    local returnString = \"|cFF\"..hex..string..\"|r\"\n    return returnString\nend\n\n\n\n\n",
				},
				["finish"] = {
					["do_custom"] = true,
					["custom"] = "aura_env.list = \"\"",
				},
			},
			["justify"] = "LEFT",
			["selfPoint"] = "TOPLEFT",
			["trigger"] = {
				["type"] = "custom",
				["subeventSuffix"] = "_CAST_START",
				["event"] = "Health",
				["unit"] = "player",
				["debuffType"] = "HELPFUL",
				["custom"] = "-- Trigger code shackle\n\nfunction(event, ...) --timestamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags,  spellid, spellName)\n    \n    local subevent = select(2, ...) -- check for aura applied / removed\n    local spellName = select(13, ...)   \n    local destName = select(9, ...) -- name of player affected \n    local SPELLID = 184931 -- spellid of shackeled torment\n    local SPELL = GetSpellInfo(SPELLID) -- save the localized name of Shackeled torment (becasue idk which is the real ID so i just use name for all cases)\n    \n    if (subevent == \"SPELL_AURA_APPLIED\") and spellName == SPELL then -- check if the aura was applied to someone\n        \n        for i=1, GetNumGroupMembers() do --for every member of your group\n            local raider = \"raid\"..i\n            if UnitName(raider) == destName then -- if they got the debuff\n                local x, y = UnitPosition(raider) -- get their position                \n                local infoTable = {NAME = destName, X = x, Y = y} -- save their position and name\n                table.insert(aura_env.playerInfo, infoTable) -- insert the info into the table\n                break -- stop looping because we found the raid id of the player with the defuff    \n            end            \n        end\n        \n    elseif  subevent == \"SPELL_AURA_REMOVED\" and spellName == SPELL then -- check if the aura is removed.\n        for k,v in pairs(aura_env.playerInfo) do -- for every player that has the debuff\n            if v.NAME == destName then -- check if their name matches\n                table.remove(aura_env.playerInfo, k)\n            end\n        end\n    end    \n    \n    if next(aura_env.playerInfo) ~= nil then -- if there are players in the list, there are shackles\n        return true\n    end\n    \n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
