					["translateFunc"] = "return function(progress, startX, startY, deltaX, deltaY)\n    local thisBuff = 173184;\n    local thisName = select(1,GetSpellInfo(thisBuff));\n    local numBuffs,buff,buffLoc,start,id,thisStart = 0,0,1,{},0;\n    local name = {\n        select(1,GetSpellInfo(108281)),   -- Ancestral Guidance\n        select(1,GetSpellInfo(114050)),   -- Ascendance\n        select(1,GetSpellInfo(108271)),   -- Astral Shift\n        select(1,GetSpellInfo(118522)),   -- Elemental Blast: Critical Strike\n        select(1,GetSpellInfo(173183)),   -- Elemental Blast: Haste\n        select(1,GetSpellInfo(thisBuff)), -- Elemental Blast: Mastery\n        select(1,GetSpellInfo(16166)),    -- Elemental Mastery\n        select(1,GetSpellInfo(79206)),    -- Spiritwalkers Grace\n        select(1,GetSpellInfo(73685)),    -- Unleash Life\n    }\n    \n    for i=1,getn(name) do\n        if (select(1,UnitBuff(\"player\",name[i])) ~= nil) then\n            start[buffLoc] = select(7,UnitBuff(\"player\",name[i])) - select(6,UnitBuff(\"player\",name[i]));\n            buffLoc = buffLoc + 1;\n        end\n    end\n    \n    sort(start);\n    \n    for i=1,getn(start) do\n        thisStart = (select(7,UnitBuff(\"player\",thisName)) or 0) - (select(6,UnitBuff(\"player\",thisName)) or 0);\n        \n        if (thisStart == start[i] and thisStart > 0) then\n            break;\n        else\n            numBuffs = numBuffs + 1;\n        end\n    end\n    \n    wipe(name);\n    wipe(start);\n    \n    return startX,(startY - (numBuffs * 18));\nend",
