			["customText"] = "function()\n    \n    local result = \"\"\n    local SpellName = \"Touch of Harm\"\n    local DEBUFF = UnitDebuff(aura_env.player, SpellName)\n    \n    if DEBUFF then \n        \n        local amount = select(15, UnitDebuff(aura_env.player, SpellName))\n        local c_amount = amount\n        \n        if(amount>999999)then\n            amount= (\"%d,%03d,%03d\"):format(math.floor(amount/1000000),math.floor(amount/1000)%1000,amount%1000)\n        elseif(amount>999)then\n            amount= (\"%d,%03d\"):format(math.floor(amount/1000),amount%1000)\n        elseif (amount<999)then\n            amount=math.floor(amount)\n        end\n        \n        if c_amount >= 1500000 then\n            amount = \"|cFFFF0000\"..amount..\"|r\"\n        elseif c_amount >= 500000 then\n            amount = \"|cFFFFA500\"..amount..\"|r\"\n        elseif c_amount < 500000 then\n            amount = \"|cFF00FF00\"..amount..\"|r\"\n        end\n        \n        local name = UnitName(aura_env.player)\n        local class = select(2, UnitClass(aura_env.player))\n        \n        local colorText = RAID_CLASS_COLORS[class] and RAID_CLASS_COLORS[class].colorStr or \"ffbbbbbb\"\n        result = result..\"|c\"..colorText..name..\"|r\"..\": \"..amount..\"|n\"\n        \n    end\n    \n    \n    return result\n    \n    \n    \n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
