			["displayText"] = "%c",
			["customText"] = "\n\nfunction(...)\n    \n    --print (select(6, ...))\n    \n    local number = select(7, ...)\n    local names =select(5, ...)\n    local playerName =  UnitName(\"player\")\n    \n    \n    \n    for n in string.gmatch(names, '([^,]+)') do\n        \n        if n ~= playerName then\n            return n\n        end\n        \n    end\n    \n    \n    \n    --[[  local SpellName = select(1, GetSpellInfo(124081))\n    for i=1, GetNumGroupMembers() do\n        local raider = \"raid\"..i\n        local BUFFS = UnitBuff(\"raid\"..i, SpellName)\n        \n        if BUFFS then\n            local name = UnitName(\"raid\"..i)\n            local expires = select(7, UnitBuff(\"raid\"..i, SpellName))\n            local caster = select(8, UnitBuff(\"raid\"..i, SpellName))\n            local current = GetTime()\n            local duration = expires - current\n            if name == \"Manager\" or caster ~= \"player\" then break end\n            if duration >=0 then\n                return string.format(\"%.0f\" , duration)\n            end\n        end\n    end]]\nend\n\n\n\n\n--[[\n\n@Krazy:\n\nfunction()\nlocal names = \"%%n\"\nlocal newNames = names - \"Manager\"\nreturn newNames\nend\n\n\n--]]\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
