				["events"] = "COMBAT_LOG_EVENT_UNFILTERED, ENCOUNTER_START",
				["custom"] = "function(event, ...)\n    \n    if event == \"ENCOUNTER_START\" then -- try to reset the table at the start of any fight.\n        aura_env.playerInfo = {}\n    end\n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        \n        local timeStamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellId, spellName, spellSchool, extraSpellID, extraSpellName, extraSchool = ... -- unfiltered events\n        \n        if subevent == \"SPELL_AURA_APPLIED\" and spellName == aura_env.SPELL then -- if the debuff went out\n            \n            local name =  string.gsub(destName, \"%-[^|]+\", \"\") -- remove realm names, if any\n            \n            table.insert(aura_env.playerInfo, name) -- insert name into table\n            \n            C_Timer.After(20, function()  aura_env.playerInfo = {} end ) -- reset table? every 20s after the first debuff?\n            \n            if #aura_env.playerInfo == 4 then -- when we have 4 players in the table\n                \n                table.sort(aura_env.playerInfo) -- sort them so every player has the same order \n                \n                local  _, _, _, _, _, _, expirationTime = UnitDebuff(\"player\",  aura_env.SPELL) -- get the time in the future when it expires\n                \n                if expirationTime == nil then -- if we dont have an expiration time, we have no debuff\n                    aura_env.playerInfo = {} -- reset table (just in case)\n                end\n                \n                local positions = {\"{star}LEFT MELEE{star}\", \"{circle}RIGHT MELEE{circle}\", \"{diamond}LEFT RANGE{diamond}\", \"{triangle}RIGHT RANGE{triangle}\"} -- postisions to /say\n                for i,v in pairs(aura_env.playerInfo) do -- for every player in the table (with the debuff)\n                    if UnitName(\"player\") == v then -- if the current players name is in the table\n                        SendChatMessage(positions[i]) -- send the msg\n                        return true\n                    end\n                end\n            end\n        end\n    end\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
