		["Mannoroth Doom Spike Distance"] = {
			["outline"] = true,
			["fontSize"] = 27,
			["xOffset"] = 1566.71899414063,
			["displayText"] = "%c",
			["customText"] = "function()\n    ------------------OPTIONS----------------------\n    --- Min/Max distance is for changing the color to red. \n    local minDistance = 30-- 0 for no min.\n    local maxDistance = 0 -- 0 for no max.\n    --------------------------------------------------\n    \n    \n    local returnString = \"\"\n    \n    if aura_env.wrathOnMe then\n        \n        \n        local _, _, _, doomCount, _, _, time = UnitDebuff(aura_env.name, \"Doom Spike\") -- get wrath stacks\n        \n        local distanceBetween = aura_env.DistanceBetweenUnits(\"player\", aura_env.tankID) -- check the distance between you and the nearest player\n        \n        -- color distance based on min/max\n        if (distanceBetween <= minDistance and minDistance ~= 0) or (distanceBetween >= maxDistance and maxDistance ~= 0) then\n            distanceBetween = \"|cFFFF0001\" .. (\"%.02f\"):format(distanceBetween) .. \"|r yds\"\n        else\n            distanceBetween = \"|cFFFFFFFF\" .. (\"%.02f\"):format(distanceBetween) .. \"|r yds\"\n        end\n        \n        -- SQUASHING STOOPID BUGS, BAD BUGS\n        if doomCount == nil then doomCount = \"nil\" end\n        if distanceBetween == nil then distanceBetween = 0 end\n        if time == nil then time = 0 end\n        --\n        \n        \n        returnString = string.format(\"%s\\n%s\\n%.01f\", doomCount, distanceBetween, time - GetTime())\n        --[[\n             return  Stack Count\n                        Distance\n                        Timer\n          ]]\n        \n    end\n    \n    if WeakAuras.IsOptionsOpen() then\n        return \"TEST TEXT\"\n    end\n    \n    return returnString\n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
			["yOffset"] = -347.504028320313,
			["regionType"] = "text",
			["activeTriggerMode"] = 0,
			["customTextUpdate"] = "update",
			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["do_custom"] = true,
					["custom"] = "aura_env.wrathOnMe = false\naura_env.tankID = \"player\"\naura_env.name = \"no name\"\n\n\n-- DistanceBetweenUnits('raid3', 'player') - Get the distance (in yards) between the player and the third raid member.\n-- DistanceBetweenUnits('raid3') - Same as above (default unit is 'player').\n-- DistanceBetweenUnits('raid19, 'party4') - Distance between raid member nineteen and player's party member four.\n-- [@unitA] string - (Optional) Friendly unit A to check.  Defaults to 'player'.\n-- [@unitB] string - (Optional) Friendly unit B to check.  Defaults to 'player'.\n-- return number - Distance (in yards) between both units.\naura_env.DistanceBetweenUnits = function(unitA, unitB)\n    unitA = unitA or 'player'\n    unitB = unitB or 'player'\n    local ax, ay = UnitPosition(unitA)\n    local bx, by = UnitPosition(unitB)\n    if ax and bx then\n        local dx = ax - bx\n        local dy = ay - by\n        return (dx * dx + dy * dy) ^ 0.5\n    end\n    return nil\nend\n--------------------------------------------------------------------\n\n\n",
				},
				["finish"] = {
				},
			},
			["untrigger"] = {
				["custom"] = "function(event, timestamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags,  spellid, spellName)\n    \n    \n    if subevent == \"SPELL_AURA_REMOVED\" and spellName == \"Doom Spike\" and destName == UnitName(aura_env.tankID) then -- check if the aura is removed.\n        \n        \n        return true\n        \n        \n    end\n    \n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
