				["custom"] = "function(event, timestamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags,  spellid, spellName)\n    \n    \n    \n    if subevent == \"SPELL_AURA_APPLIED\"  and spellid == 189717 --[[spellName == \"Doom Spike\" ]]then\n        \n        -- destName = destName -- SET SPECIFIC TANK NAME HERE IF AURA NOT WORKING. (string)\n        local e = aura_env\n        \n        e.name = destName\n        aura_env.wrathOnMe = true -- bad variable names DONT EVER DO THIS, DONT BE LAZY (im doing it anyway)\n        \n        for i=1,GetNumGroupMembers() do -- for every player in the raid\n            local raider=\"raid\"..i\n            if destName == UnitName(raider) then -- check if that player has the debuff\n                aura_env.tankID = raider\n            end\n        end   \n        \n        return true         \n        \n    end\n    \n    \n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
