			["displayText"] = "%c",
			["customText"] = "--Display\nfunction()\n    \n    if  aura_env.ouputIcon then  \n        \n        if GetSpellCooldown(aura_env.spellID) == 0 then\n            if aura_env.isSingle then\n                return  \"USE |T\" .. aura_env.ouputIcon ..\":16|t\".. aura_env.sender -- show icon\n            else \n                return  \"USE |T\" .. aura_env.ouputIcon ..\":16|t\" -- show icon\n            end\n        else \n            return \"\" \n        end\n        \n        \n    else\n        return \"Nothing? - report bug\"\n    end\n    \nend",
			["yOffset"] = 118.154418945313,
			["anchorPoint"] = "CENTER",
			["activeTriggerMode"] = 0,
			["customTextUpdate"] = "event",
			["actions"] = {
				["start"] = {
					["do_glow"] = false,
					["glow_frame"] = "WeakAuras:Cooldown Notification VERSION 2.1",
					["sound"] = "Interface\\Addons\\WeakAuras\\PowerAurasMedia\\Sounds\\sonar.ogg",
					["do_sound"] = true,
				},
				["finish"] = {
					["do_custom"] = true,
					["custom"] = "aura_env.isSingle = false",
				},
				["init"] = {
					["do_custom"] = true,
					["custom"] = "--On Init\n\nlocal split = function (msg, inSplitPattern, outResults ) -- string parser\n    \n    if not outResults then\n        outResults = { }\n    end\n    local theStart = 1\n    local theSplitStart, theSplitEnd = string.find(msg, inSplitPattern, theStart )\n    while theSplitStart do\n        table.insert( outResults, string.sub(msg, theStart, theSplitStart-1 ) )\n        theStart = theSplitEnd + 1\n        theSplitStart, theSplitEnd = string.find(msg, inSplitPattern, theStart )\n    end\n    table.insert( outResults, string.sub(msg, theStart ) )\n    return outResults\nend\n\naura_env.DoSplit = split -- save the above function as a global to this aura\naura_env.playerName = UnitName(\"player\") -- get the current player name\naura_env.ouputIcon = \"init\"\naura_env.sender = \"init\"\naura_env.playerClassIndex = select(3, UnitClass(\"player\"))\naura_env.isSingle = false\n\n\naura_env.classTable = {  -- Table for storing Single Target CDs. A spell ID being in this list means the aura will save the name of the person who sent it to display next to the icon.\n    \n    [1] = { -- Warrior\n        \"114030\" -- Vigilance\n    },\n    \n    [2] = { -- Paladin\n        \"6940\", -- Hand of Sacrifice\n        \"1022\" -- Hand of Protection\n    }, \n    \n    [5] = { -- Priest\n        \"33206\", -- Pain Suppression\n        \"47788\" -- Guardian Spirit    \n    },\n    \n    [10] = { -- Monk\n        \"116849\" -- Life Cocoon\n    },\n    \n    [11] = { -- Druid\n        \"102342\" -- Ironbark\n    }\n    \n}\n\n--custom code by ERT author\nlocal function SpecialClick(data)\n    local chat,channel={GetChannelList()}\n    for i=1,#chat,2 do\n        if string.upper(chat[i+1]) == string.upper(\"SRCDS\") then -- EDIT THE CHANNEL NAME\n            channel=chat[i]\n            break\n        end\n    end\n    \n    if not channel then return end\n    SendChatMessage(data.name..\", \"..data.db[1],\"CHANNEL\",nil,channel)\nend\n\nif _G.GExRT and _G.GExRT.A.ExCD2 then\n    _G.GExRT.A.ExCD2.db.plugin.UpdateRoster=function(line) line.specialClick=SpecialClick end\nend\n-------------------------\n\n\n",
				},
			},
			["fontFlags"] = "OUTLINE",
			["selfPoint"] = "CENTER",
			["trigger"] = {
				["custom_hide"] = "timed",
