			["displayText"] = "%c",
			["customText"] = "function()\n    \n    if aura_env.gamemode == 0 then\n        return nil\n    else\n        \n        aura_env.GameData() -- launch the game via gamemode\n        \n        if aura_env.FLAPPERS[UnitGUID(\"player\")] == nil then\n            aura_env.FLAPPERS[UnitGUID(\"player\")] = {}\n        end\n        \n        \n        aura_env.CheckWin = function()\n            if aura_env.gamemode == 1 then               \n                if aura_env.FLAPPERS[UnitGUID(\"player\")].lastflap <= aura_env.EVENTarg1 and aura_env.FLAPPERS[UnitGUID(\"player\")].lastflap >= aura_env.EVENTarg1-aura_env.EVENTarg2 then\n                    return true\n                else\n                    return false\n                    \n                end\n            end\n            \n            --add more win-checks for different games here\n            \n        end\n        \n        if aura_env.ingame == false then\n            print(aura_env.FBheader..\" Game start! <\"..aura_env.EVENTname..\">:  \"..aura_env.EVENTdesc)\n            if aura_env.gamemode == 1 then\n                aura_env.ingame = true\n                aura_env.FLAPPERS[UnitGUID(\"player\")].lastflap = 0\n                print(aura_env.FBheader..\" Win: \"..aura_env.EVENTarg1-aura_env.EVENTarg2..\" - \"..aura_env.EVENTarg1..\".00 sec.\")\n                print(aura_env.FBheader..\" Rewards: \"..aura_env.EVENTexp..\" XP.\")\n            end\n        end\n        \n    end\n    \nend",
			["untrigger"] = {
			},
			["anchorPoint"] = "CENTER",
			["activeTriggerMode"] = -10,
			["customTextUpdate"] = "update",
			["actions"] = {
				["start"] = {
					["do_message"] = false,
				},
				["finish"] = {
				},
				["init"] = {
					["do_custom"] = true,
					["custom"] = "aura_env.spellid = 164862 -- Flap\naura_env.FLAPPERS = {}\naura_env.FBheader = \"|cff009cff<FlappyBirb>:|r\"\naura_env.gamemode = 1\naura_env.ingame = false\naura_env.eventExp = 0\naura_env.EVENTname = \"\"\naura_env.EVENTdesc = \"\"\naura_env.EVENTexp = 0\naura_env.EVENTbonus = 0\naura_env.EVENTexpires = 0\naura_env.EVENTarg1 = nil\naura_env.EVENTarg2 = nil\naura_env.EVENTarg3 = nil\naura_env.EVENTarg4 = nil\naura_env.EVENTarg5 = nil\n\naura_env.GameData = function()\n    \n    local EventName, EventDesc, Goal, Exp, ExpBonus, Expires, arg1, arg2, arg3, arg4, arg5\n    \n    \n    if aura_env.gamemode == 1 then\n        aura_env.EVENTname = \"Flap Attack\"\n        aura_env.EVENTdesc = \"End flapping so your 'Last Flap' is within the time-range.\"\n        aura_env.EVENTexp = 5\n        aura_env.EVENTbonus = 0\n        aura_env.EVENTexpires = 300 --seconds the game is open\n        if aura_env.EVENTarg1 == nil then\n            aura_env.EVENTarg1 = math.random(1,3)\n        end\n        aura_env.EVENTarg2 = 0.25\n        aura_env.EVENTarg3 = nil\n        aura_env.EVENTarg4 = nil\n        aura_env.EVENTarg5 = nil    \n    end\n    \n    aura_env.eventExp = aura_env.EVENTexp +  aura_env.EVENTbonus\n    \n    return EventName, EventDesc, Goal, Exp, ExpBonus, Expires, arg1, arg2, arg3, arg4, arg5\nend\n\naura_env.ResetGameData = function()\n    aura_env.gamemode = 0\n    aura_env.ingame = false\n    aura_env.eventExp = 0\n    aura_env.EVENTname = \"\"\n    aura_env.EVENTdesc = \"\"\n    aura_env.EVENTexp = 0\n    aura_env.EVENTbonus = 0\n    aura_env.EVENTexpires = 0\n    aura_env.EVENTarg1 = nil\n    aura_env.EVENTarg2 = nil\n    aura_env.EVENTarg3 = nil\n    aura_env.EVENTarg4 = nil\n    aura_env.EVENTarg5 = nil\n    return nil\nend\n\n\n\n-- write to file, nil checks\nif  WeakAurasSaved.displays[aura_env.id]['lifetime'] == nil then  WeakAurasSaved.displays[aura_env.id]['lifetime'] = 0 end\n\nif  WeakAurasSaved.displays[aura_env.id]['curLevel'] == nil then  WeakAurasSaved.displays[aura_env.id]['curLevel'] = 1 end\n\nif  WeakAurasSaved.displays[aura_env.id]['curExp'] == nil then  WeakAurasSaved.displays[aura_env.id]['curExp'] = 0 end",
				},
			},
			["fontFlags"] = "OUTLINE",
			["selfPoint"] = "BOTTOM",
			["trigger"] = {
				["type"] = "custom",
				["custom_type"] = "event",
				["debuffType"] = "HELPFUL",
				["event"] = "Health",
				["subeventPrefix"] = "SPELL",
				["names"] = {
				},
				["unit"] = "player",
				["custom"] = "function(event, ...)\n    \n    --[[\n(time,type,_,sourceGUID,_,_,_,destGUID,destname,_,_,spellid,spellname,_,_,_,_,_,_,_,_,_,_,_,_)\n]]\n    \n    local CurrentTime = GetTime();\n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        if select(2, ...) == \"SPELL_CAST_SUCCESS\" and select(12, ...) == aura_env.spellid then\n            \n            local sourceGUID = select(4, ...)\n            \n            if aura_env.FLAPPERS[sourceGUID] == nil then\n                aura_env.FLAPPERS[sourceGUID] = aura_env.FLAPPERS[sourceGUID] or {}    \n            end\n            \n            if aura_env.FLAPPERS[sourceGUID] ~= nil then\n                if aura_env.FLAPPERS[sourceGUID].start ~= nil and aura_env.FLAPPERS[sourceGUID].start > 0 then\n                    aura_env.FLAPPERS[sourceGUID].start = aura_env.FLAPPERS[sourceGUID].start\n                else\n                    aura_env.FLAPPERS[sourceGUID].start = CurrentTime\n                end\n                aura_env.FLAPPERS[sourceGUID].name = select(5, ...)\n                aura_env.FLAPPERS[sourceGUID].count = 0\n                aura_env.FLAPPERS[sourceGUID].lastflap = 0\n                aura_env.FLAPPERS[sourceGUID].totalflap = 0\n                aura_env.FLAPPERS[sourceGUID].count = aura_env.FLAPPERS[sourceGUID].count + 1\n            end\n        end\n        \n        if select(2, ...) == \"SPELL_AURA_APPLIED\" and select(12, ...) == aura_env.spellid then\n            local sourceGUID = select(4, ...)\n            if aura_env.FLAPPERS[sourceGUID] == nil then\n                aura_env.FLAPPERS[sourceGUID] = {} \n            else\n                aura_env.FLAPPERS[sourceGUID].currentflap = 0\n            end\n        end\n        \n        if select(2, ...) == \"SPELL_AURA_REMOVED\" and select(12, ...) == aura_env.spellid then\n            \n            local sourceGUID = select(4, ...)\n            \n            \n            aura_env.FLAPPERS[sourceGUID].stop = CurrentTime\n            aura_env.FLAPPERS[sourceGUID].lastflap = aura_env.FLAPPERS[sourceGUID].stop - aura_env.FLAPPERS[sourceGUID].start\n            aura_env.FLAPPERS[sourceGUID].start = 0 -- reset\n            \n            aura_env.FLAPPERS[sourceGUID].totalflap = aura_env.FLAPPERS[sourceGUID].totalflap + aura_env.FLAPPERS[sourceGUID].lastflap\n            aura_env.FLAPPERS[sourceGUID].average = math.floor(aura_env.FLAPPERS[sourceGUID].totalflap / aura_env.FLAPPERS[sourceGUID].count)\n            \n            -- write to file\n            \n            WeakAurasSaved.displays[aura_env.id]['lifetime'] = WeakAurasSaved.displays[aura_env.id]['lifetime'] + aura_env.FLAPPERS[sourceGUID].totalflap\n            \n            WeakAurasSaved.displays[aura_env.id]['lifetime'] = 0\n            if WeakAurasSaved.displays[aura_env.id]['lifetime'] ~= 0 then\n                print( math.floor(WeakAurasSaved.displays[aura_env.id]['lifetime']))            \n            end\n            \n            local str_lastflap = string.format(\"%.3f\", aura_env.FLAPPERS[sourceGUID].lastflap)\n            print(\"|cff009cff<FlappyBirb>:|r\"..\" Last Flap: \"..str_lastflap..\" sec.\")\n        end\n        \n        if aura_env.ingame == true then\n            \n            if aura_env.CheckWin() == true then\n                \n                \n                PlaySound(\"vo_zg2_mandokir_levelup_event_01\", \"Master\")\n                \n                WeakAurasSaved.displays[aura_env.id]['curExp'] = WeakAurasSaved.displays[aura_env.id]['curExp'] + aura_env.eventExp\n                \n                print(aura_env.FBheader..\" WINRAWR!   +\"..aura_env.eventExp..\"xp   (Total: \"..WeakAurasSaved.displays[aura_env.id]['curExp']..\")\")\n                WeakAurasSaved.displays[aura_env.id]['curExp'] = 0\n                \n                --reset the game data\n                aura_env.ResetGameData()\n            end\n        end\n    end\nend\n\n\n\n\n\n\n\n",
