				["custom"] = "function (_, UID, spellName, _, _, spellID)\n    if UID~=\"player\" then return false end\n    \n    -- start animations\n    aura_env.time = GetTime()\n    \n    -- set counter\n    local _,_,_,stacks,_,_,expires = UnitBuff(\"player\", \"Hit Combo\")\n    \n    if stacks==nil then\n        aura_env.counter=0\n    elseif stacks<10 then\n        aura_env.counter=stacks\n    elseif expires-GetTime()>=10 then -- If ability was something that refreshed the buff back to 10sec.\n        aura_env.counter = aura_env.counter+1 or 1\n    else\n        return false\n    end\n    \n    aura_env.last_spell = spellName\n    local red, green, blue\n    \n    -- maybe alpha things but spellID is not giving the expected ID.\n    -- set color by spell used to reference what NOT to use next time\n    if spellName==\"Tiger Palm\" then\n        -- tiger palm / teal\n        red = 8/255\n        green = 222/255\n        blue = 197/255\n    elseif spellName==\"Blackout Kick\" then\n        -- blackout kick / purple\n        red = 216/255\n        green = 61/255\n        blue = 181/255\n    else\n        -- anything else / orange\n        red = 217/255\n        green = 104/255\n        blue = 50/255\n    end\n    \n    WeakAuras.regions[\"HitCombo-Moon\"].region:Color(red, green, blue, .7)\n    WeakAuras.regions[\"HitCombo-Swirl\"].region:Color(red, green, blue, .7)\n    \n    -- rotate graphics for eyecandy\n    aura_env.rotations = {random(-80, 80), random(-80, 80), random(-80, 80)}\n    \n    return true    \nend",
