				["customDuration"] = "function()\n    local start, dur\n    \n    if aura_env.burst then\n        \n        start, dur = GetSpellCooldown(\"Rushing Jade Wind\")\n        \n    elseif aura_env.wave then\n        local stacks = select(4, UnitBuff (\"player\", \"Hit Combo\")) or 0\n       \n        return stacks, 8, true\n        --return 0, 0, true\n        \n    end\n    \n    if dur < 1.5 then\n        WeakAuras.regions[aura_env.id].region.icon:SetDesaturated(false)\n        return 0,0 \n    else\n        start = start or 0\n        dur = dur or 0\n        WeakAuras.regions[aura_env.id].region.icon:SetDesaturated(true)\n        return dur, start+dur\n    end\n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
