		["T90"] = {
			["xOffset"] = 101,
			["customText"] = "function()\n    \nend\n\n\n\n\n",
			["yOffset"] = -13,
			["anchorPoint"] = "CENTER",
			["activeTriggerMode"] = -10,
			["customTextUpdate"] = "update",
			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["do_custom"] = true,
					["custom"] = "aura_env.duration = 0\naura_env.expirationTime = 0\naura_env.stacks = 0\n\naura_env.dW, aura_env.dH = WeakAuras.regions[aura_env.id].region:GetSize()\naura_env.scale = 1.3\n\naura_env.icon = 0\n\n\naura_env.dots = function()\n    -- MODE 0 is for TOTAL_DOTS.\n    -- MODE 1 is for expected Astral Power per 1 sec.\n    -- MODE 2 is for expected Astral Power per YOUR RATE (in seconds).\n    \n    \n    \n    local MODE = 0\n    -- you may change this to 0, 1, or 2.\n    \n    \n    if TOTAL_DOTS == nil then -- in case this global variable hasn't intitialized yet\n        TOTAL_DOTS = 0\n    end\n    \n    local proc = 0.10\n    local asp = 5\n    local Haste = UnitSpellHaste('player')/100 \n    local dots = (TOTAL_DOTS / (2/(1+Haste))) \n    local output = (dots * asp * proc)\n    if MODE == 0 then \n        return TOTAL_DOTS \n    end\n    if MODE == 1 then\n        return string.format(\"%.2f\",output)\n    end\n    if MODE == 2 then\n        \n        \n        \n        local RATE = 5\n        -- your own time (in seconds); ex. 5 = 5sec.\n        \n        \n        \n        return string.format(\"%.2f\",output*RATE)\n    end\n    return TOTAL_DOTS -- in case you set the MODE to something that isn't 0, 1, or 2.\nend\n\n\n",
				},
				["finish"] = {
				},
			},
			["fontFlags"] = "OUTLINE",
			["selfPoint"] = "TOPLEFT",
			["trigger"] = {
				["use_matchedRune"] = false,
				["ownOnly"] = true,
				["names"] = {
					"Moonfire", -- [1]
				},
				["customIcon"] = "function()\n    \n     \n    return aura_env.icon\n    \nend\n\n\n\n\n",
				["use_unit"] = true,
				["custom_hide"] = "timed",
				["unevent"] = "auto",
				["debuffType"] = "HARMFUL",
				["check"] = "update",
				["type"] = "custom",
				["realSpellName"] = "Force of Nature",
				["custom_type"] = "status",
				["use_showOn"] = true,
				["custom"] = "function()\n    \n    local FoN, _, FID = select(4, GetTalentInfo(6,1,1))\n    local WoE, _,WID = select(4, GetTalentInfo(6,2,1))\n    local SrL, _, SID = select(4, GetTalentInfo(6,3,1))\n    \n    \n    if FoN then \n        \n        local dots = aura_env.dots()\n        aura_env.name, _, aura_env.icon = GetSpellInfo(FID)\n        aura_env.duration = dots\n        aura_env.expirationTime = dots\n        aura_env.stacks = dots\n        \n    elseif WoE then\n        \n        start, aura_env.duration = GetSpellCooldown(WID)\n        aura_env.name, _, aura_env.icon = GetSpellInfo(WID)\n        aura_env.expirationTime = start + aura_env.duration\n        aura_env.stacks = nil\n        \n    elseif SrL then\n        \n        start, aura_env.duration = GetSpellCooldown(SID)\n        \n        local yellow, _, yellowIcon = GetSpellInfo(202739)\n        local blue, _, blueIcon = GetSpellInfo(202737)\n        \n        \n        if  UnitBuff(\"player\", yellow) then\n            WeakAuras.regions[aura_env.id].region:SetSize(aura_env.dW,aura_env.dH)\n            aura_env.icon = yellowIcon\n        elseif  UnitBuff(\"player\", blue) then\n            WeakAuras.regions[aura_env.id].region:SetSize(aura_env.dW,aura_env.dH)\n            aura_env.icon = blueIcon\n        else\n            WeakAuras.regions[aura_env.id].region:SetSize(aura_env.dW * aura_env.scale,aura_env.dH * aura_env.scale)\n           -- WeakAuras.regions[aura_env.id].region:SetSize(100, 150)\n            aura_env.icon = select(3, GetSpellInfo(SID))\n        end\n        \n        aura_env.expirationTime = start + aura_env.duration\n        aura_env.stacks = nil\n        \n    end\n    \n    return true\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
