				["init"] = {
					["do_custom"] = true,
					["custom"] = "aura_env.triggered = false\naura_env.amount = 0\naura_env.petInfo = {}\n\nlocal iLevel = 741 -- this should stay at around 735 during actual use. Unless you know the ilvl of ring in your raid, it may be inaccurate (less damage) but right now its more effiecnt.\n\naura_env.multiplier = 0.25 * 1.15^((iLevel-735)/15); -- assume 735 for now.  Might be too  intensive to inspect the player with the buff. (idk if we can even auto inspect during combat)\n\naura_env.commaFormat = function(amount)\n    local formatted = amount\n    while true do  \n        formatted, k = string.gsub(formatted, \"^(-?%d+)(%d%d%d)\", '%1,%2')\n        if (k==0) then\n            break\n        end\n    end\n    return formatted\nend",
				},
