				["subeventSuffix"] = "_CAST_START",
				["custom"] = "-- Trigger\n\n--version 1.1: added removing of marks\n\nfunction(event, timestamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags,  spellid, spellName)\n    \n    local SPELL = \"Touch of Doom\"\n    --local SPELL = \"Rejuvenation\"\n    \n    \n    \n    if subevent == \"SPELL_AURA_APPLIED\" and spellName == SPELL then\n        \n        aura_env.count = aura_env.count + 1\n        \n        local name =  string.gsub(destName, \"%-[^|]+\", \"\") -- remove realm names, if any\n        \n        for i=1,GetNumGroupMembers() do\n            local raider=\"raid\"..i\n            local raiderName = UnitName(raider)\n            raiderName = string.gsub(raiderName, \"%-[^|]+\", \"\") -- remove realm names, if any\n            \n            --[[  \n            Number - Raid icon index; 0 to remove any icons from the unit.\n            1 = Yellow 4-point Star\n            2 = Orange Circle\n            3 = Purple Diamond\n            4 = Green Triangle\n            5 = White Crescent Moon\n            6 = Blue Square\n            7 = Red \"X\" Cross\n            8 = White Skull\n            ]]\n            \n            if raiderName == name then\n                if aura_env.count == 1 then\n                    table.insert(aura_env.raiderTable, raider)\n                    SetRaidTarget(raider, 6); -- square\n                elseif aura_env.count == 2 then\n                    table.insert(aura_env.raiderTable, raider)\n                    SetRaidTarget(raider, 4); -- triangle\n                elseif aura_env.count == 3 then\n                    table.insert(aura_env.raiderTable, raider)\n                    SetRaidTarget(raider, 3); -- diamond\n                end\n            end-- end if\n        end -- end for raiders\n        \n    elseif  subevent == \"SPELL_AURA_REMOVED\" and spellName == SPELL then -- check if the aura is removed.\n        for k,v in pairs(aura_env.raiderTable) do\n            SetRaidTarget(v, 0);\n        end\n        aura_env.raiderTable = {}\n        aura_env.count = 0\n        \n        \n        \n    end -- end if spell add/remove\n    return true \nend\n\n\n\n\n\n",
