				["customDuration"] = "function()\n    \n    local gcd, gcdDUR = GetSpellCooldown(61304) -- GCD\n    \n    if aura_env.stacks then\n        WeakAuras.regions[aura_env.id].region.icon:SetDesaturated(false)\n        return aura_env.duration,  aura_env.expirationTime, aura_env.stacks\n    end \n    \n    if aura_env.expirationTime == gcd + gcdDUR  then -- true when nothing is happeneing\n        WeakAuras.regions[aura_env.id].region.icon:SetDesaturated(false)\n    elseif aura_env.expirationTime > gcd + gcdDUR then\n        WeakAuras.regions[aura_env.id].region.icon:SetDesaturated(true)\n        return aura_env.duration,  aura_env.expirationTime, aura_env.stacks\n    end\nend\n\n\n\n\n\n\n",
